UPDATE [dbo].[MATURITY_QUESTIONS] SET [Supplemental_Info]=N'<div class="sub-header-1">ASSESSMENT OBJECTIVES [NIST SP 800-171A]</div>  Determine if:  <ol class="alpha-bracket">  <li>authorized users are identified;</li>  <li>processes acting on behalf of authorized users are identified;</li>  <li>devices (and other systems) authorized to connect to the system are identified;</li>  <li>system access is limited to authorized users;</li>  <li>system access is limited to processes acting on behalf of authorized users; and</li>  <li>system access is limited to authorized devices (including other systems).</li>  </ol>    <div class="sub-header-1">POTENTIAL ASSESSMENT METHODS AND OBJECTS</div>  <div class="sub-header-2">Examine</div>  <p>[SELECT FROM: Access control policy; procedures addressing account management; system security plan; system design documentation; system configuration settings and associated documentation; list of active system accounts and the name of the individual associated with each account; notifications or records of recently transferred, separated, or terminated employees; list of conditions for group and role membership; list of recently disabled system accounts along with the name of the individual associated with each account; access authorization records; account management compliance reviews; system monitoring records; system audit logs and records; list of devices and systems authorized to connect to organizational systems; other relevant documents or records].</p>  <div class="sub-header-2">Interview</div>  <p>[SELECT FROM: Personnel with account management responsibilities; system or network administrators; personnel with information security responsibilities].</p>  <p>It is recommended that an OSA develop a SSP as a best practice at Level 1, however, it is not required in order to obtain a Level 1 self-assessment.</p>  <div class="sub-header-2">Test</div>  <p>[SELECT FROM: Organizational processes for managing system accounts; mechanisms for implementing account management].</p>    <div class="sub-header-1">DISCUSSION</div>  <p>Access control policies (e.g., identity- or role-based policies, control matrices, and cryptography) control access between active entities or subjects (i.e., users or processes acting on behalf of users) and passive entities or objects (e.g., devices, files, records, and domains) in systems. Access enforcement mechanisms can be employed at the application and service level to provide increased information security. Other systems include systems internal and external to the organization. This requirement focuses on account management for systems and applications. The definition of and enforcement of access authorizations, other than those determined by account type (e.g., privileged verses [sic] non-privileged) are addressed in AC.L1-b.1.ii.</p>    <div class="sub-header-1">FURTHER DISCUSSION</div>  <p>Identify users, processes, and devices that are allowed to use company computers and can log on to the company network. Automated updates and other automatic processes should be associated with the user who initiated (authorized) the process. Limit the devices (e.g., printers) that can be accessed by company computers. Set up your system so that only authorized users, processes, and devices can access the company network.</p>  <p>This requirement, AC.L1-b.1.i, controls system access based on user, process, or device identity. AC.L1-b.1.i leverages IA.L1-b.1.v which provides a vetted and trusted identity for access control.</p>  <div class="sub-header-2">Example 1</div>  <p>Your company maintains a list of all personnel authorized to use company information systems [a]. This list is used to support identification and authentication activities conducted by IT when authorizing access to systems [a,d].</p>  <div class="sub-header-2">Example 2</div>  <p>A coworker wants to buy a new multi-function printer/scanner/fax device and make it available on the company network. You explain that the company controls system and device access to the network, and will prevent network access by unauthorized systems and devices [c]. You help the coworker submit a ticket that asks for the printer to be granted access to the network, and appropriate leadership approves the device [f].</p>  <div class="sub-header-2">Potential Assessment Considerations</div>  <ul>  <li>Is a list of authorized users maintained that defines their identities and roles [a]?</li>  <li>Are account requests authorized before system access is granted [d,e,f]?</li>  </ul>' WHERE [Mat_Question_Id] = 5270
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Supplemental_Info]=N'<div class="sub-header-1">ASSESSMENT OBJECTIVES [NIST SP 800-171A]</div>  Determine if:  <ol class="alpha-bracket">  <li>malicious code protection mechanisms are updated when new releases are available.</li>  </ol>    <div class="sub-header-1">POTENTIAL ASSESSMENT METHODS AND OBJECTS</div>  <div class="sub-header-2">Examine</div>  <p>[SELECT FROM: System and information integrity policy; configuration management policy and procedures; procedures addressing malicious code protection; malicious code protection mechanisms; records of malicious code protection updates; system security plan; system design documentation; system configuration settings and associated documentation; scan results from malicious code protection mechanisms; record of actions initiated by malicious code protection mechanisms in response to malicious code detection; system audit logs and records; other relevant documents or records].</p>  <div class="sub-header-2">Interview</div>  <p>[SELECT FROM: System or network administrators; personnel with information security responsibilities; personnel installing, configuring, and maintaining the system; personnel with responsibility for malicious code protection; personnel with configuration management responsibility].</p>  <div class="sub-header-2">Test</div>  <p>[SELECT FROM: Organizational processes for employing, updating, and configuring malicious code protection mechanisms; organizational process for addressing false positives and resulting potential impact; mechanisms supporting or implementing malicious code protection mechanisms (including updates and configurations); mechanisms supporting or implementing malicious code scanning and subsequent actions].</p>    <div class="sub-header-1">DISCUSSION</div>  <p>Malicious code protection mechanisms include anti-virus signature definitions and reputation-based technologies. A variety of technologies and methods exist to limit or eliminate the effects of malicious code. Pervasive configuration management and comprehensive software integrity controls may be effective in preventing execution of unauthorized code. In addition to commercial off-the-shelf software, malicious code may also be present in custom-built software. This could include logic bombs, back doors, and other types of cyber-attacks that could affect organizational missions/business functions. Traditional malicious code protection mechanisms cannot always detect such code. In these situations, organizations rely instead on other safeguards including secure coding practices, configuration management and control, trusted procurement processes, and monitoring practices to help ensure that software does not perform functions other than the functions intended.</p>    <div class="sub-header-1">FURTHER DISCUSSION</div>  <p>Malware changes on an hourly or daily basis, and it is important to update detection and protection mechanisms frequently to maintain the effectiveness of the protection.</p>  <div class="sub-header-2">Example</div>  <p>You have installed anti-malware software to protect a computer that stores FCI from malicious code. Knowing that malware evolves rapidly, you configure the software to automatically check for malware definition updates every day and update as needed [a].</p>  <div class="sub-header-2">Potential Assessment Considerations</div>  <ul>  <li>Is there a defined frequency at which malicious code protection mechanisms must be updated (e.g., frequency of automatic updates or manual processes) [a]?</li>  </ul>    ' WHERE [Mat_Question_Id] = 5283
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Supplemental_Info]=N'<div class="sub-header-1">ASSESSMENT OBJECTIVES [NIST SP 800-171A]</div>  Determine if:  <ol class="alpha-bracket">  <li>the frequency for malicious code scans is defined;</li>  <li>malicious code scans are performed with the defined frequency; and</li>  <li>real-time malicious code scans of files from external sources as files are downloaded, opened, or executed are performed.</li>  </ol>    <div class="sub-header-1">POTENTIAL ASSESSMENT METHODS AND OBJECTS</div>  <div class="sub-header-2">Examine</div>  <p>[SELECT FROM: System and information integrity policy; configuration management policy and procedures; procedures addressing malicious code protection; malicious code protection mechanisms; records of malicious code protection updates; system security plan; system design documentation; system configuration settings and associated documentation; scan results from malicious code protection mechanisms; record of actions initiated by malicious code protection mechanisms in response to malicious code detection; system audit logs and records; other relevant documents or records].</p>  <div class="sub-header-2">Interview</div>  <p>[SELECT FROM: System or network administrators; personnel with information security responsibilities; personnel installing, configuring, and maintaining the system; personnel with responsibility for malicious code protection; personnel with configuration management responsibility].</p>  <div class="sub-header-2">Test</div>  <p>[SELECT FROM: Organizational processes for employing, updating, and configuring malicious code protection mechanisms; organizational process for addressing false positives and resulting potential impact; mechanisms supporting or implementing malicious code protection mechanisms (including updates and configurations); mechanisms supporting or implementing malicious code scanning and subsequent actions].</p>    <div class="sub-header-1">DISCUSSION</div>  <p>Periodic scans of organizational systems and real-time scans of files from external sources can detect malicious code. Malicious code can be encoded in various formats (e.g., UUENCODE, Unicode), contained within compressed or hidden files, or hidden in files using techniques such as steganography. Malicious code can be inserted into systems in a variety of ways including web accesses, electronic mail, electronic mail attachments, and portable storage devices. Malicious code insertions occur through the exploitation of system vulnerabilities.</p>    <div class="sub-header-1">FURTHER DISCUSSION</div>  <p>Consider use of anti-malware software to scan for viruses in your computer systems and determine how often scans are conducted. Real-time scans look at the system whenever files are downloaded, opened, and saved. Periodic scans check previously saved files against updated malware information. Anti-malware software should be installed, run, and updated on all hosts for which satisfactory antivirus software is available.</p>  <div class="sub-header-2">Example</div>  <p>Your company transmits FCI over email. You work with your companys email provider to enable enhanced protections that will scan all attachments to identify and quarantine those that may be harmful prior to a user opening them [c]. In addition, you configure antivirus software on each computer to scan for malicious code every day [a,b]. The software also scans files that are downloaded or copied from removable media such as USB drives. It quarantines any suspicious files and notifies the security team [c].</p>  <div class="sub-header-2">Potential Assessment Considerations</div>  <ul>  <li>Are files from media (e.g., USB drives, CD-ROM) included in the definition of external sources and are they being scanned [c]?</li>  </ul>    ' WHERE [Mat_Question_Id] = 5284
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Supplemental_Info]=N'<div class="sub-header-1">ASSESSMENT OBJECTIVES [NIST SP 800-171A]</div>  Determine if:  <ol class="alpha-bracket">  <li>conditions requiring a user session to terminate are defined; and</li>  <li>a user session is automatically terminated after any of the defined conditions occur.</li>  </ol>    <div class="sub-header-1">POTENTIAL ASSESSMENT METHODS AND OBJECTS</div>  <div class="sub-header-2">Examine</div>  <p>[SELECT FROM: Access control policy; procedures addressing session termination; system design documentation; system security plan; system configuration settings and associated documentation; list of conditions or trigger events requiring session disconnect; system audit logs and records; other relevant documents or records].</p>  <div class="sub-header-2">Interview</div>  <p>[SELECT FROM: System or network administrators; personnel with information security responsibilities; system developers].</p>  <div class="sub-header-2">Test</div>  <p>[SELECT FROM: Mechanisms implementing user session termination].</p>    <div class="sub-header-1">DISCUSSION</div>  <p>This requirement addresses the termination of user-initiated logical sessions in contrast to the termination of network connections that are associated with communications sessions (i.e., disconnecting from the network). A logical session (for local, network, and remote access) is initiated whenever a user (or process acting on behalf of a user) accesses an organizational system. Such user sessions can be terminated (and thus terminate user access) without terminating network sessions. Session termination terminates all processes associated with a users logical session except those processes that are specifically created by the user (i.e., session owner) to continue after the session is terminated. Conditions or trigger events requiring automatic session termination can include organization-defined periods of user inactivity, targeted responses to certain types of incidents, and time-of-day restrictions on system use.</p>    <div class="sub-header-1">FURTHER DISCUSSION</div>  <p>Configure the system to terminate user sessions based on the organizations policy. Session termination policies can be simple or sophisticated. Examples are inactivity (end the session after a specified duration (e.g., one hour) of inactivity), day/time (all sessions are terminated at the end of the established workday), misbehavior (end the session due to an attempted policy violation), and maintenance (terminate sessions to prevent issues with an upgrade or service outage). If there is no automatic control of user sessions, an attacker can take advantage of an unattended session.</p>  <div class="sub-header-2">Example 1</div>  <p>You manage systems containing CUI for your organization and configure the system to terminate all user sessions after 1 hour of inactivity [a]. As the session timeout approaches, the system prompts users with a warning banner asking if they want to continue the session. When the session timeout does occur, the login page pops up, and the users must log in to start a new session [b].</p>  <div class="sub-header-2">Example 2</div>  <p>A user is logged into a corporate database containing CUI but is not authorized to view CUI. The user has submitted a series of queries that unintentionally violate policy, as they attempt to extract CUI that the user is not authorized to view [a]. The session terminates with a warning as a result of a violation of corporate policy [b]. The user must reestablish the session before being able to submit additional legitimate queries.</p>  <div class="sub-header-2">Potential Assessment Considerations</div>  <ul>  <li>Are the conditions in which a user session must be terminated described (e.g., after a period of inactivity or after a defined time limit) [a]?</li>  <li>Are procedures documented that describe how to configure the system to enable automatic termination of user sessions after any of the defined conditions occur [b]?</li>  <li>Are user sessions terminated based on organization-defined conditions [a,b]?</li>  </ul>    ' WHERE [Mat_Question_Id] = 5295
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Supplemental_Info]=N'<div class="sub-header-1">ASSESSMENT OBJECTIVES [NIST SP 800-171A]</div>  Determine if:  <ol class="alpha-bracket">  <li>the use of portable storage devices containing CUI on external systems is identified and documented;</li>  <li>limits on the use of portable storage devices containing CUI on external systems are defined; and</li>  <li>the use of portable storage devices containing CUI on external systems is limited as defined.</li>  </ol>    <div class="sub-header-1">POTENTIAL ASSESSMENT METHODS AND OBJECTS</div>  <div class="sub-header-2">Examine</div>  <p>[SELECT FROM: Access control policy; procedures addressing the use of external systems; system security plan; system configuration settings and associated documentation; system connection or processing agreements; account management documents; other relevant documents or records].</p>  <div class="sub-header-2">Interview</div>  <p>[SELECT FROM: Personnel with responsibilities for restricting or prohibiting use of organization-controlled storage devices on external systems; system or network administrators; personnel with information security responsibilities].</p>  <div class="sub-header-2">Test</div>  <p>[SELECT FROM: Mechanisms implementing restrictions on use of portable storage devices].</p>    <div class="sub-header-1">DISCUSSION</div>  <p>Limits on the use of organization-controlled portable storage devices in external systems include complete prohibition of the use of such devices or restrictions on how the devices may be used and under what conditions the devices may be used. Note that while external typically refers to outside of the organizations direct supervision and authority that is not always the case. Regarding the protection of CUI across an organization, the organization may have systems that process CUI and others that do not. Among the systems that process CUI there are likely access restrictions for CUI that apply between systems. Therefore, from the perspective of a given system, other systems within the organization may be considered external" to that system.</p>    <div class="sub-header-1">FURTHER DISCUSSION</div>  <p>A portable storage device is a system component that can be inserted or attached and easily removed from a system. It is used to store data or information. Examples of portable storage devices include:</p>  <ul>  <li>compact/digital video disks (CDs/DVDs);</li>  <li>Universal Serial Bus (USB) drives;</li>  <li>external hard disk drives;</li>  <li>flash memory cards/drives; and</li>  <li>floppy disks.</li>  </ul>  <p>This requirement can be implemented in two ways:</p>  <ul>  <li>identifying the portable storage device usage restrictions, identifying portable storage devices that may be used on external systems, identifying associated external systems on which a portable storage device may be used, and administratively (through the use of a written policy) limiting the usage of the devices to those systems; or</li>  <li>configuring devices to work only when connected to a system to which the portable storage device can authenticate, limiting the devices use on external systems to those that the OSA has the ability to manage.</li>  </ul>  <div class="sub-header-2">Example</div>  <p>Your organization, which stores and processes CUI, has a written portable device usage restriction policy. It states that users can only use external storage devices such as thumb dives or external hard disks that belong to the company. When needed for a specific business function, a user checks the device out from IT and returns it to IT when no longer needed [a,b].</p>  <div class="sub-header-2">Potential Assessment Considerations</div>  <ul>  <li>Are the portable storage devices authorized for external use identified and documented [a]?</li>  <li>Are the circumstances defined in which portable storage devices containing CUI may be used on external systems (e.g., with management approval) [b]?</li>  <li>Are limitations stipulated for the use of portable storage devices containing CUI on external systems (e.g., authorized personnel only, encrypted drives required) [b]?</li>  </ul>    ' WHERE [Mat_Question_Id] = 5305
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Supplemental_Info]=N'<div class="sub-header-1">ASSESSMENT OBJECTIVES [NIST SP 800-171A]</div>  Determine if:  <ol class="alpha-bracket">  <li>media containing CUI is marked with applicable CUI markings; and</li>  <li>media containing CUI is marked with distribution limitations.</li>  </ol>    <div class="sub-header-1">POTENTIAL ASSESSMENT METHODS AND OBJECTS</div>  <div class="sub-header-2">Examine</div>  <p>[SELECT FROM: System media protection policy; procedures addressing media marking; physical and environmental protection policy and procedures; system security plan; list of system media marking security attributes; designated controlled areas; other relevant documents or records].</p>  <div class="sub-header-2">Interview</div>  <p>[SELECT FROM: Personnel with system media protection and marking responsibilities; personnel with information security responsibilities].</p>  <div class="sub-header-2">Test</div>  <p>[SELECT FROM: Organizational processes for marking information media; mechanisms supporting or implementing media marking].</p>    <div class="sub-header-1">DISCUSSION</div>  <p>The term security marking refers to the application or use of human-readable security attributes. System media includes digital and non-digital media. Marking of system media reflects applicable federal laws, Executive Orders, directives, policies, and regulations.</p>    <div class="sub-header-1">FURTHER DISCUSSION</div>  <p>All media, hardcopy and digital, must be properly marked to alert individuals to the presence of CUI stored on the media. The National Archives and Records Administration (NARA) has published guidelines for labeling media of different sizes.</p>  <p>MP.L2-3.8.8 requires that media have an identifiable owner, so organizations may find it desirable to include ownership information on the device label as well.</p>  <div class="sub-header-2">Example</div>  <p>You were recently contacted by the project team for a new DoD program. The team said they wanted the CUI in use for the program to be properly protected. When speaking with them, you realize that most of the protections will be provided as part of existing enterprise cybersecurity capabilities. They also mentioned that the project team will use several USB drives to share specific data. You explain that the team must ensure the USB drives are externally marked to indicate the presence of CUI [a]. The project team labels the outside of each USB drive with an appropriate CUI label following NARA guidance [a]. Further, the labels indicate that distribution is limited to those employees supporting the DoD program [a].</p>  <div class="sub-header-2">Potential Assessment Considerations</div>  <ul>  <li>Are all media containing CUI identified [a,b]?</li>  </ul>    ' WHERE [Mat_Question_Id] = 5351
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Supplemental_Info]=N'<div class="sub-header-1">ASSESSMENT OBJECTIVES [NIST SP 800-171A]</div>  Determine if:  <ol class="alpha-bracket">  <li>the confidentiality of CUI stored on digital media is protected during transport using cryptographic mechanisms or alternative physical safeguards.</li>  </ol>    <div class="sub-header-1">POTENTIAL ASSESSMENT METHODS AND OBJECTS</div>  <div class="sub-header-2">Examine</div>  <p>[SELECT FROM: System media protection policy; procedures addressing media transport; system design documentation; system security plan; system configuration settings and associated documentation; system media transport records; system audit logs and records; other relevant documents or records].</p>  <div class="sub-header-2">Interview</div>  <p>[SELECT FROM: Personnel with system media transport responsibilities; personnel with information security responsibilities].</p>  <div class="sub-header-2">Test</div>  <p>[SELECT FROM: Cryptographic mechanisms protecting information on digital media during transportation outside controlled areas].</p>    <div class="sub-header-1">DISCUSSION</div>  <p>This requirement applies to portable storage devices (e.g., USB memory sticks, digital video disks, compact disks, external or removable hard disk drives).</p>  <p>NIST SP 800-111 provides guidance on storage encryption technologies for end user devices.</p>    <div class="sub-header-1">FURTHER DISCUSSION</div>  <p>CUI can be stored and transported on a variety of portable media, which increases the chance that the CUI can be lost. When identifying the paths CUI flows through your company, identify devices to include in this requirement.</p>  <p>To mitigate the risk of losing or exposing CUI, implement an encryption scheme to protect the data. Even if the media are lost, proper encryption renders the data inaccessible. When encryption is not an option, apply alternative physical safeguards during transport.</p>  <p>Because the use of cryptography in this requirement is to protect the confidentiality of CUI, the cryptography used must meet the criteria specified in requirement SC.L2-3.13.11.</p>  <p>This requirement, MP.L2-3.8.6, provides additional protections to those provided by MP.L2-3.8.5. This requirement is intended to protect against situations where control of media access fails, such as through the loss of the media.</p>  <div class="sub-header-2">Example</div>  <p>You manage the backups for file servers in your datacenter. You know that in addition to the companys sensitive information, CUI is stored on the file servers. As part of a broader plan to protect data, you send the backup tapes off site to a vendor. You are aware that your backup software provides the option to encrypt data onto tape. You develop a plan to test and enable backup encryption for the data sent off site. This encryption provides additional protections for the data on the backup tapes during transport and offsite storage [a].</p>  <div class="sub-header-2">Potential Assessment Considerations</div>  <ul>  <li>Are all CUI data on media encrypted or physically protected prior to transport outside of controlled areas [a]?</li>  <li>Are cryptographic mechanisms used to protect digital media during transport outside of controlled areas [a]?</li>  <li>Do cryptographic mechanisms comply with FIPS 140-2 [a]?</li>  </ul>    ' WHERE [Mat_Question_Id] = 5353
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Supplemental_Info]=N'<div class="sub-header-1">ASSESSMENT OBJECTIVES [NIST SP 800-171A]</div>  Determine if:  <ol class="alpha-bracket">  <li>a policy and/or process for terminating system access and any credentials coincident with personnel actions is established;</li>  <li>system access and credentials are terminated consistent with personnel actions such as termination or transfer; and</li>  <li>the system is protected during and after personnel transfer actions.</li>  </ol>    <div class="sub-header-1">POTENTIAL ASSESSMENT METHODS AND OBJECTS</div>  <div class="sub-header-2">Examine</div>  <p>[SELECT FROM: Personnel security policy; procedures addressing personnel transfer and termination; records of personnel transfer and termination actions; list of system accounts; records of terminated or revoked authenticators and credentials; records of exit interviews; other relevant documents or records].</p>  <div class="sub-header-2">Interview</div>  <p>[SELECT FROM: Personnel with personnel security responsibilities; personnel with account management responsibilities; system or network administrators; personnel with information security responsibilities].</p>  <div class="sub-header-2">Test</div>  <p>[SELECT FROM: Organizational processes for personnel transfer and termination; mechanisms supporting or implementing personnel transfer and termination notifications; mechanisms for disabling system access and revoking authenticators].</p>    <div class="sub-header-1">DISCUSSION</div>  <p>Protecting CUI during and after personnel actions may include returning system-related property and conducting exit interviews. System-related property includes hardware authentication tokens, identification cards, system administration technical manuals, keys, and building passes. Exit interviews ensure that individuals who have been terminated understand the security constraints imposed by being former employees and that proper accountability is achieved for system-related property. Security topics of interest at exit interviews can include reminding terminated individuals of nondisclosure agreements and potential limitations on future employment. Exit interviews may not be possible for some terminated individuals, for example, in cases related to job abandonment, illnesses, and non- availability of supervisors. For termination actions, timely execution is essential for individuals terminated for cause. In certain situations, organizations consider disabling the system accounts of individuals that are being terminated prior to the individuals being notified.</p>  <p>This requirement applies to reassignments or transfers of individuals when the personnel action is permanent or of such extended durations as to require protection. Organizations define the CUI protections appropriate for the types of reassignments or transfers, whether permanent or extended. Protections that may be required for transfers or reassignments to other positions within organizations include returning old and issuing new keys, identification cards, and building passes; changing system access authorizations (i.e., privileges); closing system accounts and establishing new accounts; and providing for access to official records to which individuals had access at previous work locations and in previous system accounts.</p>    <div class="sub-header-1">FURTHER DISCUSSION</div>  <p>Employee access to CUI is removed when they change jobs or leave the company. When employment or program access is terminated for any reason, the following actions may occur within the defined time frame:</p>  <ul>  <li>all company IT equipment (e.g., laptops, cell phones, storage devices) is returned;</li>  <li>all identification, access cards, and keys are returned; and</li>  <li>an exit interview is conducted to remind the employee of their obligations to not discuss CUI, even after employment.</li>  </ul>  <p>Additionally, perform the following:</p>  <ul>  <li>remove access to all accounts granting access to CUI or modify access to CUI as appropriate for a new work role;</li>  <li>disable or close employee accounts for departing employees; and</li>  <li>limit access to physical spaces with CUI for departing employees or those who transition to a work role that does not require access to CUI.</li>  </ul>  <p>This requirement, PS.L2-3.9.2, leverages the identification of system users required by IA.L2-3.5.1 in order to ensure that all accesses are identified and removed.</p>  <div class="sub-header-2">Example 1</div>  <p>You are in charge of IT operations. Per organizational policies, when workers leave the company, you remove them from any physical CUI access lists. If you are not their supervisor, you contact their supervisor or human resources immediately and ask them to:</p>  <ul>  <li>turn in the former employees computers for proper handling;</li>  <li>inform help desk or system administrators to have the former employees system access revoked;</li>  <li>retrieve the former employees identification and access cards; and</li>  <li>have the former employees attend an exit interview where you or human resources remind them of their obligations to not discuss CUI [b].</li>  </ul>  <div class="sub-header-2">Example 2</div>  <p>An employee transfers from one working group in your company to another. Human resources team notifies IT of the transfer date, and the employees new manager follows procedure by submitting a ticket to the IT help desk to provide information on the access rights the employee will require in their new role. IT implements the rights for the new position and revokes the access for the prior position on the official date of the transfer [c].</p>  <div class="sub-header-2">Potential Assessment Considerations</div>  <ul>  <li>Is information system access disabled upon employee termination or transfer [c]?</li>  <li>Are authenticators/ credentials associated with the employee revoked upon termination or transfer within a certain time frame [b,c]?</li>  <li>Is all company information system-related property retrieved from the terminated or transferred employee within a certain timeframe [a,c]?</li>  <li>Is access to company information and information systems formerly controlled by the terminated or transferred employee retained for a certain timeframe [a,c]?</li>  <li>Is the information security office and data owner of the change in authorization notified within a certain timeframe [a]?</li>  </ul>    ' WHERE [Mat_Question_Id] = 5358
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Supplemental_Info]=N'<div class="sub-header-1">ASSESSMENT OBJECTIVES [NIST SP 800-171A]</div>  Determine if:  <ol class="alpha-bracket">  <li>the frequency to assess risk to organizational operations, organizational assets, and individuals is defined; and</li>  <li>risk to organizational operations, organizational assets, and individuals resulting from the operation of an organizational system that processes, stores, or transmits CUI is assessed with the defined frequency.</li>  </ol>    <div class="sub-header-1">POTENTIAL ASSESSMENT METHODS AND OBJECTS</div>  <div class="sub-header-2">Examine</div>  <p>[SELECT FROM: Risk assessment policy; security planning policy and procedures; procedures addressing organizational risk assessments; system security plan; risk assessment; risk assessment results; risk assessment reviews; risk assessment updates; other relevant documents or records].</p>  <div class="sub-header-2">Interview</div>  <p>[SELECT FROM: Personnel with risk assessment responsibilities; personnel with information security responsibilities].</p>  <div class="sub-header-2">Test</div>  <p>[SELECT FROM: Organizational processes for risk assessment; mechanisms supporting or for conducting, documenting, reviewing, disseminating, and updating the risk assessment].</p>    <div class="sub-header-1">DISCUSSION</div>  <p>Clearly defined system boundaries are a prerequisite for effective risk assessments. Such risk assessments consider threats, vulnerabilities, likelihood, and impact to organizational operations, organizational assets, and individuals based on the operation and use of organizational systems. Risk assessments also consider risk from external parties (e.g., service providers, contractor operating systems on behalf of the organization, individuals accessing organizational systems, outsourcing entities). Risk assessments, either formal or informal, can be conducted at the organization level, the mission or business process level, or the system level, and at any phase in the system development life cycle.</p>  <p>NIST SP 800-30 provides guidance on conducting risk assessments.</p>    <div class="sub-header-1">FURTHER DISCUSSION</div>  <p>Risk arises from anything that can reduce an organizations assurance of mission/business success; cause harm to image or reputation; or harm individuals, other organizations, or the Nation.</p>  <p>Organizations assess the risk to their operations and assets at regular intervals. Areas where weakness or vulnerabilities could lead to risk may include:</p>  <ul>  <li>poorly designed and executed business processes;</li>  <li>inadvertent actions of people, such as disclosure or modification of information;</li>  <li>intentional actions of people inside and outside the organization;</li>  <li>failure of systems to perform as intended;</li>  <li>failures of technology; and</li>  <li>external events, such as natural disasters, public infrastructure and supply chain failures.</li>  </ul>  <p>When conducting risk assessments use established criteria and procedures. The results of formal risk assessments are documented. It is important to note that risk assessments differ from vulnerability assessments (see RA.L2-3.11.2). A vulnerability assessment provides input to a risk assessment along with other information such as results from likelihood analysis and analysis of potential treat sources.</p>  <p>Risk assessments should be performed at defined regular intervals. Mission risks include anything that will keep an organization from meeting its mission. Function risk is anything that will prevent the performance of a function. Image and reputation risks refer to intangible risks that have value and could cause damage to potential or future trust relationships.</p>  <p>This requirement, RA.L2-3.11.1, which requires periodically assessing the risk to organization systems, assets, and individuals, is a baseline Risk Assessment requirement. RA.L2-3.11.1 enables other Risk Assessment requirements (e.g., RA.L2-3.11.3, Vulnerability Remediation), as well as CA.L2-3.12.2, Plan of Action.</p>  <div class="sub-header-2">Example</div>  <p>You are a system administrator. You and your team members are working on a big government contract requiring you to store CUI. As part of your periodic (e.g., annual) risk assessment exercise, you evaluate the new risk involved with storing CUI [a,b]. When conducting the assessment you consider increased legal exposure, financial requirements of safeguarding CUI, potentially elevated attention from external attackers, and other factors.</p>  <p>After determining how storing CUI affects your overall risk profile, you use that as a basis for a conversation on how that risk should be mitigated.</p>  <div class="sub-header-2">Potential Assessment Considerations</div>  <ul>  <li>Have initial and periodic risk assessments been conducted [b]?</li>  <li>Are methods defined for assessing risk (e.g., reviewing security assessments, incident reports, and security advisories, identifying threat sources, threat events, and vulnerabilities, and determining likelihood, impact, and overall risk to the confidentiality of CUI) [b]?</li>  </ul>    ' WHERE [Mat_Question_Id] = 5365
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Supplemental_Info]=N'<div class="sub-header-1">ASSESSMENT OBJECTIVES [NIST SP 800-171A]</div>  Determine if:  <ol class="alpha-bracket">  <li>a system security plan is developed;</li>  <li>the system boundary is described and documented in the system security plan;</li>  <li>the system environment of operation is described and documented in the system security plan;</li>  <li>the security requirements identified and approved by the designated authority as non-applicable are identified;</li>  <li>the method of security requirement implementation is described and documented in the system security plan;</li>  <li>the relationship with or connection to other systems is described and documented in the system security plan;</li>  <li>the frequency to update the system security plan is defined; and</li>  <li>system security plan is updated with the defined frequency.</li>  </ol>    <div class="sub-header-1">POTENTIAL ASSESSMENT METHODS AND OBJECTS</div>  <div class="sub-header-2">Examine</div>  <p>[SELECT FROM: Security planning policy; procedures addressing system security plan development and implementation; procedures addressing system security plan reviews and updates; enterprise architecture documentation; system security plan; records of system security plan reviews and updates; other relevant documents or records].</p>  <div class="sub-header-2">Interview</div>  <p>[SELECT FROM: Personnel with security planning and system security plan implementation responsibilities; personnel with information security responsibilities].</p>  <div class="sub-header-2">Test</div>  <p>[SELECT FROM: Organizational processes for system security plan development, review, update, and approval; mechanisms supporting the system security plan].</p>    <div class="sub-header-1">DISCUSSION</div>  <p>System security plans relate security requirements to a set of security controls. System security plans also describe, at a high level, how the security controls meet those security requirements, but do not provide detailed, technical descriptions of the design or implementation of the controls. System security plans contain sufficient information to enable a design and implementation that is unambiguously compliant with the intent of the plans and subsequent determinations of risk if the plan is implemented as intended. Security plans need not be single documents; the plans can be a collection of various documents including documents that already exist. Effective security plans make extensive use of references to policies, procedures, and additional documents (e.g., design and implementation specifications) where more detailed information can be obtained. This reduces the documentation requirements associated with security programs and maintains security-related information in other established management/operational areas related to enterprise architecture, system development life cycle, systems engineering, and acquisition.</p>  <p>Federal agencies may consider the submitted system security plans and plans of action as critical inputs to an overall risk management decision to process, store, or transmit CUI on a system hosted by a nonfederal organization and whether it is advisable to pursue an agreement or contract with the nonfederal organization.</p>  <p>NIST SP 800-18 provides guidance on developing security plans.</p>    <div class="sub-header-1">FURTHER DISCUSSION</div>  <p>A system security plan (SSP) is a document that outlines how an organization implements its security requirements. OSAs must have an SSP in place at the time of assessment to describe each information system within the CMMC Assessment Scope. The absence of an up-to-date SSP at the time of the assessment would result in a finding that an assessment could not be completed due to incomplete information and noncompliance with DFARS clause 252.204-7012. OSAs are free to choose the format of their SSP. At a minimum, an SSP must include:</p>  <ul>  <li>Description of the CMMC Assessment Scope;</li>  <li>CMMC Assessment Scope Description: high-level description of the assets within the assessment scope;</li>  <li>Description of the Environment of Operation: physical surroundings in which an information system processes, stores, and transmits information;</li>  <li>Identified and Approved Security Requirements: requirements levied on an information system that are derived from applicable laws, Executive Orders, directives, policies, standards, instructions, regulations, procedures, or organizational mission/business case needs to ensure the confidentiality, integrity, and availability of the information being processed, stored, or transmitted;</li> <li>Implementation Method for Security Requirements: description of how the identified and approved security requirements are implemented with the system or environment;</li>  <li>Connections and Relationships to Other Systems and Networks: description of related, dependent, and interconnected systems; and</li>  <li>Defined Frequency of Updates: at least annually.</li>  </ul>  <p>In addition to the requirements above, an SSP often includes:</p>  <ul>  <li>general information system description: technical and functional description;</li>  <li>design philosophies: defense-in-depth strategies and allowed interfaces and network protocols; and</li>  <li>roles and responsibilities: description of the roles and responsibilities for key personnel, which may include the system owner, system custodian, authorizing officials, and other stakeholders</li>  </ul>  <p>This requirement, CA.L2-3.12.4, which requires developing, documenting, and updating system security plans, promotes effective information security within organizational systems required by SC.L2-3.13.2, as well as other system and communications protection requirements.</p>  <div class="sub-header-2">Example</div>  <p>You are in charge of system security. You develop an SSP and have senior leadership formally approve the document [a]. The SSP explains how your organization handles CUI and defines how that data is stored, transmitted, and protected [d,e]. The criteria outlined in the SSP is used to guide configuration of the network and other information resources to meet your companys goals. Knowing that it is important to keep the SSP current, you establish a policy that requires a formal review and update of the SSP each year [g,h].</p>  <div class="sub-header-2">Potential Assessment Considerations</div>  <ul>  <li>Do mechanisms exist to develop and periodically update an SSP [a,g]?</li>  <li>Are security requirements identified and approved by the designated authority as non-applicable documented [d]?</li>  </ul>    ' WHERE [Mat_Question_Id] = 5371
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Supplemental_Info]=N'<div class="sub-header-1">ASSESSMENT OBJECTIVES [NIST SP 800-171A]</div>  Determine if:  <ol class="alpha-bracket">  <li>designated locations for malicious code protection are identified; and</li>  <li>protection from malicious code at designated locations is provided.</li>  </ol>    <div class="sub-header-1">POTENTIAL ASSESSMENT METHODS AND OBJECTS</div>  <div class="sub-header-2">Examine</div>  <p>[SELECT FROM: System and information integrity policy; configuration management policy and procedures; procedures addressing malicious code protection; records of malicious code protection updates; malicious code protection mechanisms; system security plan; system configuration settings and associated documentation; record of actions initiated by malicious code protection mechanisms in response to malicious code detection; scan results from malicious code protection mechanisms; system design documentation; system audit logs and records; other relevant documents or records].</p>  <div class="sub-header-2">Interview</div>  <p>[SELECT FROM: System or network administrators; personnel with information security responsibilities; personnel installing, configuring, and maintaining the system; personnel with responsibility for malicious code protection; personnel with configuration management responsibility].</p>  <div class="sub-header-2">Test</div>  <p>[SELECT FROM: Organizational processes for employing, updating, and configuring malicious code protection mechanisms; organizational process for addressing false positives and resulting potential impact; mechanisms supporting or implementing employing, updating, and configuring malicious code protection mechanisms; mechanisms supporting or implementing malicious code scanning and subsequent actions].</p>    <div class="sub-header-1">DISCUSSION</div>  <p>Designated locations include system entry and exit points which may include firewalls, remote access servers, workstations, electronic mail servers, web servers, proxy servers, notebook computers, and mobile devices. Malicious code includes viruses, worms, Trojan horses, and spyware. Malicious code can be encoded in various formats (e.g., UUENCODE, Unicode), contained within compressed or hidden files, or hidden in files using techniques such as steganography. Malicious code can be inserted into systems in a variety of ways including web accesses, electronic mail, electronic mail attachments, and portable storage devices. Malicious code insertions occur through the exploitation of system vulnerabilities.</p>  <p>Malicious code protection mechanisms include anti-virus signature definitions and reputation-based technologies. A variety of technologies and methods exist to limit or eliminate the effects of malicious code. Pervasive configuration management and comprehensive software integrity controls may be effective in preventing execution of unauthorized code. In addition to commercial off-the-shelf software, malicious code may also be present in custom-built software. This could include logic bombs, back doors, and other types of cyber-attacks that could affect organizational missions/business functions. Traditional malicious code protection mechanisms cannot always detect such code. In these situations, organizations rely instead on other safeguards including secure coding practices, configuration management and control, trusted procurement processes, and monitoring technologies to help ensure that software does not perform functions other than the functions intended. NIST SP 800-83 provides guidance on malware incident prevention.</p>    <div class="sub-header-1">FURTHER DISCUSSION</div>  <p>A designated location may be a network device such as a firewall or an end users computer.</p>  <p>Malicious code, which can be delivered by a range of means (e.g., email, removable media, or websites), includes the following:</p>  <ul>  <li>virus  program designed to damage, steal information, change data, send email, show messages, or any combination of these things;</li>  <li>spyware  program designed to gather information about a persons activity in secret when they click on a link, usually installed without the person knowing ;</li>  <li>trojan horse  type of malware made to look like legitimate software and used by cyber criminals to get access to a companys systems; and</li>  <li>ransomware  type of malware that threatens to publish the victims data or perpetually block access to it unless a ransom is paid.</li>  </ul>  <p>Use anti-malware tools to stop or lessen the impact of malicious code.</p>  <div class="sub-header-2">Example</div>  <p>You are buying a new computer and want to protect your companys information from viruses, spyware, etc. You buy and install anti-malware software [a,b].</p>  <div class="sub-header-2">Potential Assessment Considerations</div>  <ul>  <li>Are system components (e.g., workstations, servers, email gateways, mobile devices) for which malicious code protection must be provided identified and documented [a]?</li>  </ul>    ' WHERE [Mat_Question_Id] = 5389
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Supplemental_Info]=N'<div class="sub-header-1">ASSESSMENT OBJECTIVES [NIST SP 800-171A]</div>  Determine if:  <ol class="alpha-bracket">  <li>the frequency for malicious code scans is defined;</li>  <li>malicious code scans are performed with the defined frequency; and</li>  <li>real-time malicious code scans of files from external sources as files are downloaded, opened, or executed are performed.</li>  </ol>    <div class="sub-header-1">POTENTIAL ASSESSMENT METHODS AND OBJECTS</div>  <div class="sub-header-2">Examine</div>  <p>[SELECT FROM: System and information integrity policy; configuration management policy and procedures; procedures addressing malicious code protection; malicious code protection mechanisms; records of malicious code protection updates; system security plan; system design documentation; system configuration settings and associated documentation; scan results from malicious code protection mechanisms; record of actions initiated by malicious code protection mechanisms in response to malicious code detection; system audit logs and records; other relevant documents or records].</p>  <div class="sub-header-2">Interview</div>  <p>[SELECT FROM: System or network administrators; personnel with information security responsibilities; personnel installing, configuring, and maintaining the system; personnel with responsibility for malicious code protection; personnel with configuration management responsibility].</p>  <div class="sub-header-2">Test</div>  <p>[SELECT FROM: Organizational processes for employing, updating, and configuring malicious code protection mechanisms; organizational process for addressing false positives and resulting potential impact; mechanisms supporting or implementing malicious code protection mechanisms (including updates and configurations); mechanisms supporting or implementing malicious code scanning and subsequent actions].</p>    <div class="sub-header-1">DISCUSSION</div>  <p>Periodic scans of organizational systems and real-time scans of files from external sources can detect malicious code. Malicious code can be encoded in various formats (e.g., UUENCODE, Unicode), contained within compressed or hidden files, or hidden in files using techniques such as steganography. Malicious code can be inserted into systems in a variety of ways including web accesses, electronic mail, electronic mail attachments, and portable storage devices. Malicious code insertions occur through the exploitation of system vulnerabilities.</p>    <div class="sub-header-1">FURTHER DISCUSSION</div>  <p>Use anti-malware software to scan for and identify viruses in your computer systems and determine how often scans are conducted. Real-time scans look at the system whenever new files are downloaded, opened, and saved. Periodic scans check previously saved files against updated malware information.</p>  <div class="sub-header-2">Example</div>  <p>You work with your companys email provider to enable enhanced protections that will scan all attachments to identify and quarantine those that may be harmful prior to a user opening them [c]. In addition, you configure antivirus software on each computer to scan for malicious code every day [a,b]. The software also scans files that are downloaded or copied from removable media such as USB drives. It quarantines any suspicious files and notifies the security team [c].</p>  <div class="sub-header-2">Potential Assessment Considerations</div>  <ul>  <li>Are files from media (e.g., USB drives, CD-ROM) included in the definition of external sources and are they being scanned [c]?</li>  </ul>    ' WHERE [Mat_Question_Id] = 5392
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Supplemental_Info]=N'<div class="sub-header-1">ASSESSMENT OBJECTIVES [NIST SP 800-171A]</div>  Determine if:  <ol class="alpha-bracket">  <li>[ODP1] Secure information transfer solutions are defined;</li>  <li>Information flows between security domains on connected systems are identified; and</li>  <li>Secure information transfer solutions are employed to control information flows between security domains on connected systems.</li>  </ol>    <div class="sub-header-1">POTENTIAL ASSESSMENT METHODS AND OBJECTS</div>  <div class="sub-header-2">Examine</div>  <p>[SELECT FROM: Access control policy; information flow control policies; procedures addressing information flow enforcement; system design documentation; security plan; system configuration settings and associated documentation; system audit records; system baseline configuration; list of information flow authorizations; other relevant documents or records].</p>  <div class="sub-header-2">Interview</div>  <p>[SELECT FROM: System and network administrators; organizational personnel responsible for information security; system developers].</p>  <div class="sub-header-2">Test</div>  <p>[SELECT FROM: Mechanisms implementing information flow enforcement policy; mechanisms implementing secure information transfer solutions].</p>    <div class="sub-header-1">DISCUSSION</div>  <p>Organizations employ information flow control policies and enforcement mechanisms to control the flow of information between designated sources and destinations within systems and between connected systems. Flow control is based on the characteristics of the information and/or the information path. Enforcement occurs, for example, in boundary protection devices that employ rule sets or establish configuration settings that restrict system services, provide a packet-filtering capability based on header information, or provide a message-filtering capability based on message content. Organizations also consider the trustworthiness of filtering and inspection mechanisms (i.e., hardware, firmware, and software components) that are critical to information flow enforcement.</p>  <p>Transferring information between systems in different security domains with different security policies introduces the risk that the transfers violate one or more domain security policies. In such situations, information owners or information stewards provide guidance at designated policy enforcement points between connected systems. Organizations mandate specific architectural solutions when required to enforce logical or physical separation between systems in different security domains. Enforcement includes prohibiting information transfers between connected systems, employing hardware mechanisms to enforce one-way information flows, verifying write permissions before accepting information from another security domain or connected system, and implementing trustworthy regrading mechanisms to reassign security attributes and labels.</p>  <p>Secure information transfer solutions often include one or more of the following properties: use of cross-domain solutions when traversing security domains, mutual authentication of the sender and recipient (using hardware-based cryptography), encryption of data in transit and at rest, isolation from other domains, and logging of information transfers (e.g., title of file, file size, cryptographic hash of file, sender, recipient, transfer time and Internet Protocol [IP] address, receipt time, and IP address).</p>    <div class="sub-header-1">FURTHER DISCUSSION</div>  <p>The organization implementing this requirement must decide on the secure information transfer solutions they will use. The solutions must be configured to have strong protection mechanisms for information flow between security domains. Secure information transfer solutions control information flow between a Level 3 enclave and other CMMC or non-CMMC enclaves. If CUI requiring Level 3 protection resides in one area of the environment or within a given enclave outside of the normal working environment, protection to prevent unauthorized personnel from accessing, disseminating, and sharing the protected information is required. Physical and virtual methods can be employed to implement secure information transfer solutions.</p>  <div class="sub-header-2">Example</div>  <p>You are the administrator for an enterprise that stores and processes CUI requiring Level 3 protection. The files containing CUI information are tagged by the company as CUI. To ensure secure information transfer, you use an intermediary device to check the transfer of any CUI files. The device sits at the boundary of the CUI enclave, is aware of all other CUI domains in the enterprise, and has the ability to examine the metadata in the encrypted payload. The tool checks all outbound communications paths. It first checks the metadata for all data being transferred. If that data is identified as CUI, the device checks the destination to see if the transfer is to another, sufficiently certified CUI domain. If the destination is not a sufficient CUI domain, the tool blocks the communication path and does not allow the transfer to take place. If the destination is a sufficient CUI domain, the transfer is allowed. The intermediary device logs all blocks.</p>  <div class="sub-header-2">Potential Assessment Considerations</div>  <ul>  <li>Has the organization defined the secure information transfer solutions it is using [b]?</li>  <li>Has the organization defined domains, boundaries, and flows between those domains that need to be controlled [a]?</li>  <li>Has the organization defined attributes to be associated with the CUI, and both source and destination objects [b]?</li>  <li>Has the organization defined metadata or some other tagging mechanism to be used as a means of enforcing CUI flow control [b]?</li>  <li>Has the organization defined filters to be used as a basis for enforcing flow control decisions [b]?</li>  <li>Has the organization identified CUI flows for which flow control decisions are to be applied and enforced [a,b]?</li>  </ul>    ' WHERE [Mat_Question_Id] = 5396
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Supplemental_Info]=N'<div class="sub-header-1">ASSESSMENT OBJECTIVES [NIST SP 800-171A]</div>  Determine if:  <ol class="alpha-bracket">  <li>Automated discovery and management tools for the inventory of system components are identified;</li>  <li>An up-to-date, complete, accurate, and readily available inventory of system components exists; and</li>  <li>Automated discovery and management tools are employed to maintain an up-to-date, complete, accurate, and readily available inventory of system components.</li>  </ol>    <div class="sub-header-1">POTENTIAL ASSESSMENT METHODS AND OBJECTS</div>  <div class="sub-header-2">Examine</div>  <p>[SELECT FROM: Configuration management policy; configuration management plan; procedures addressing system component inventory; procedures addressing the baseline configuration of the system; configuration management plan; system design documentation; system architecture and configuration documentation; security plan; system configuration settings and associated documentation; configuration change control records; system inventory records; change control records; system maintenance records; system audit records; other relevant documents or records].</p>  <div class="sub-header-2">Interview</div>  <p>[SELECT FROM: Organizational personnel responsible for information security; organizational personnel responsible for configuration management; organizational personnel responsible for managing the automated mechanisms implementing the system component inventory; system developers; system/network administrators].</p>  <div class="sub-header-2">Test</div>  <p>[SELECT FROM: Automated mechanisms implementing baseline configuration maintenance; automated mechanisms implementing the system component inventory].</p>    <div class="sub-header-1">DISCUSSION</div>  <p>The system component inventory includes system-specific information required for component accountability and to provide support to identify, control, monitor, and verify configuration items in accordance with the authoritative source. The information necessary for effective accountability of system components includes the system name, hardware and software component owners, hardware inventory specifications, software license information, software version numbers, and for networked componentsthe machine names and network addresses. Inventory specifications include the manufacturer, supplier information, component type, date of receipt, cost, model, serial number, and physical location. Organizations also use automated mechanisms to implement and maintain authoritative (i.e., up-to-date, complete, accurate, and available) baseline configurations for systems that include hardware and software inventory tools, configuration management tools, and network management tools. Tools can be used to track version numbers on operating systems, applications, types of software installed, and current patch levels.</p>    <div class="sub-header-1">FURTHER DISCUSSION</div>  <p>Organizations use an automated capability to discover components connected to the network and system software installed. The automated capability must also be able to identify attributes associated with those components. For systems that have already been coupled to the environment, they should allow remote access for inspection of the system software configuration and components. Another option is to place an agent on systems that performs internal system checks to identify system software configuration and components. Collection of switch and router data can also be used to identify systems on networks.</p>  <div class="sub-header-2">Example</div>  <p>Within your organization, you are in charge of implementing an authoritative inventory of system components. You first create a list of the automated technologies you will use and what each technology will be responsible for identifying [a]. This includes gathering information from switches, routers, access points, primary domain controllers, and all connected systems or devices, whether wired or wireless (printers, IoT, IIoT, OT, IT, etc.) [b]. To keep the data up-to-date, you set a very short search frequency for identifying new components. To maximize availability of this data, all information will be placed in a central inventory/configuration management system, and automated reporting is performed every day [c]. A user dashboard is set up that allows you and other administrators to run reports at any time.</p>  <div class="sub-header-2">Potential Assessment Considerations</div>  <ul>  <li>Can the organization explain the process by which current inventory information is acquired [a]?</li>  <li>Is the organization able to produce an inventory of components on the network [b,c]?</li>  <li>Has the organization implemented a valid frequency for the component discovery solution [b,c]?</li>  <li>Can the organization demonstrate that the inventory is current and accurate [b]?</li>  <li>Has the organization developed a defined list of identifiable attributes for each component type, and is that list adequate to support component accountability [a]?</li>  <li>Is the organization able to track, monitor, and verify configuration items in accordance with the organizations authoritative list of components [b,c]?</li>  </ul>    ' WHERE [Mat_Question_Id] = 5401
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Supplemental_Info]=N'<div class="sub-header-1">ASSESSMENT OBJECTIVES [NIST SP 800-171A]</div>  Determine if:  <ol class="alpha-bracket">  <li>[ODP1] Sources of threat intelligence are defined;</li>  <li>A risk assessment methodology is identified;</li>  <li>Threat intelligence, at a minimum from open or commercial sources, and any DoD-provided sources, are employed as part of a risk assessment to guide and inform the development of organizational systems and security architectures;</li>  <li>Threat intelligence, at a minimum from open or commercial sources, and any DoD-provided sources, are employed as part of a risk assessment to guide and inform the selection of security solutions;</li>  <li>Threat intelligence, at a minimum from open or commercial sources, and any DoD-provided sources, are employed as part of a risk assessment to guide and inform system monitoring activities;</li>  <li>Threat intelligence, at a minimum from open or commercial sources, and any DoD-provided sources, are employed as part of a risk assessment to guide and inform threat hunting activities; and</li>  <li>Threat intelligence, at a minimum from open or commercial sources, and any DoD-provided sources, are employed as part of a risk assessment to guide and inform response and recovery activities.</li>  </ol>    <div class="sub-header-1">POTENTIAL ASSESSMENT METHODS AND OBJECTS</div>  <div class="sub-header-2">Examine</div>  <p>[SELECT FROM: Information security program plan; risk assessment policy; threat awareness program documentation; procedures for the threat awareness program; security planning policy and procedures; procedures addressing organizational assessments of risk; threat hunting program documentation; procedures for the threat hunting program; risk assessment results relevant to threat awareness; threat hunting results; list or other documentation on the cross-organization, information-sharing capability; security plan; risk assessment; risk assessment results; risk assessment reviews; risk assessment updates; contingency planning policy; contingency plan; incident response policy; incident response plan; other relevant documents or records].</p>  <div class="sub-header-2">Interview</div>  <p>[SELECT FROM: Organizational personnel responsible for information security program planning and plan implementation; organizational personnel responsible for the threat awareness and threat hunting programs; organizational personnel responsible for risk assessments; organizational personnel responsible for the cross-organization, information- sharing capability; organizational personnel responsible for information security; organizational personnel responsible for contingency planning; organizational personnel responsible for incident response; personnel with whom threat awareness information is shared by the organization].</p>  <div class="sub-header-2">Test</div>  <p>[SELECT FROM: Mechanisms supporting and/or implementing the threat awareness program; mechanisms supporting and/or implementing the cross-organization, information-sharing capability; mechanisms supporting and/or implementing the threat hunting program; mechanisms for conducting, documenting, reviewing, disseminating, and updating risk assessments; mechanisms supporting and/or implementing contingency plans; mechanisms supporting and/or implementing incident response plans].</p>    <div class="sub-header-1">DISCUSSION</div>  <p>The constant evolution and increased sophistication of adversaries, especially the APT, makes it more likely that adversaries can successfully compromise or breach organizational systems. Accordingly, threat intelligence can be integrated into each step of the risk management process throughout the system development life cycle. This risk management process includes defining system security requirements, developing system and security architectures, selecting security solutions, monitoring (including threat hunting), and remediation efforts.</p>  <p>[NIST SP 800-30] provides guidance on risk assessments. [NIST SP 800-39] provides guidance on the risk management process. [NIST SP 800-160-1] provides guidance on security architectures and systems security engineering. [NIST SP 800-150] provides guidance on cyber threat information sharing.</p>    <div class="sub-header-1">FURTHER DISCUSSION</div>  <p>An organization consumes threat intelligence and improves their security posture based on the intelligence relevant to that organization and/or a system(s). The organization can obtain threat intelligence from open or commercial sources but must also use any DoD-provided sources. Threat information can be received in high volumes from various providers and must be processed and analyzed by the organization. It is the responsibility of the organization to process the threat information in a manner that is useful and actionable to their needs. Processing, analyzing, and extracting the intelligence from the threat feeds and applying it to all organizational security engineering needs is the primary benefit of this requirement. Note that more than one source is required to meet assessment objectives.</p>  <div class="sub-header-2">Example</div>  <p>Your organization receives a commercial threat intelligence feed from FIRST and government threat intelligence feeds from both USCERT and DoD/DC3 to help learn about recent threats and any additional information the threat feeds provide [b,c,d,e,f]. Your organization uses the threat intelligence for multiple purposes:</p>  <ul>  <li>To perform up-to-date risk assessments for the organization [a];</li>  <li>To add rules to the automated system put in place to identify threats (indicators of compromise, or IOCs) on the organizations network [e];</li>  <li>To guide the organization in making informed selections of security solutions [c];</li>  <li>To shape the way the organization performs system monitoring activities [d];</li>  <li>To manage the escalation process for identified incidents, handling specific events, and performing recovery actions [f];</li>  <li>To provide additional information to the hunt team to identify threat activities [e];</li>  <li>To inform the development and design decisions for organizational systems and the overall security architecture, as well as the network architecture [b,c];</li>  <li>To assist in decision-making regarding systems that are part of the primary network and systems that are placed in special enclaves for additional protections [b]; and</li>  <li>To determine additional security measures based on current threat activities taking place in similar industry networks [c,d,e,f].</li>  </ul>  <div class="sub-header-2">Potential Assessment Considerations</div>  <ul>  <li>Does the organization detail how threat feed information is to be ingested, analyzed, and used [a]?</li>  <li>Can the organizations SOC or hunt teams discuss how they use the threat feed information after it is processed [e,f]?</li>  </ul>    ' WHERE [Mat_Question_Id] = 5407
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Supplemental_Info]=N'<div class="sub-header-1">ASSESSMENT OBJECTIVES [NIST SP 800-171A]</div>  Determine if:  <div>[ODP4] Organizational systems to search for indicators of compromise are defined;</div><ol class="alpha-bracket">  <li>Indicators of compromise are identified;</li>  <li>Cyber threat hunting activities are conducted on an on-going aperiodic basis or when indications warrant, to search for indicators of compromise in organizational systems; and</li>  <li>Cyber threat hunting activities are conducted on an on-going aperiodic basis or when indications warrant, to detect, track, and disrupt threats that evade existing controls.</li>  </ol>    <div class="sub-header-1">POTENTIAL ASSESSMENT METHODS AND OBJECTS</div>  <div class="sub-header-2">Examine</div>  <p>[SELECT FROM: System and information integrity policy; policy and procedures addressing system monitoring; threat hunting program documentation; procedures for the threat hunting program; threat hunting results; system design documentation; security plan; system monitoring tools and techniques documentation; security planning policy and procedures; system configuration settings and associated documentation; system monitoring logs or records; system audit records; other relevant documents or records].</p>  <div class="sub-header-2">Interview</div>  <p>[SELECT FROM: Organizational personnel responsible for threat hunting program; system/network administrators; organizational personnel responsible for information security; system developers; organizational personnel installing, configuring, and/or maintaining the system; organizational personnel responsible for monitoring the system and/or network].</p>  <div class="sub-header-2">Test</div>  <p>[SELECT FROM: Mechanisms supporting and/or implementing a threat hunting program; mechanisms supporting and/or implementing a system monitoring capability; mechanisms supporting and/or supporting and/or implementing incident response plans].</p>    <div class="sub-header-1">DISCUSSION</div>  <p>Threat hunting is an active means of defense that contrasts with traditional protection measures, such as firewalls, intrusion detection and prevention systems, quarantining malicious code in sandboxes, and Security Information and Event Management (SIEM) technologies and systems. Cyber threat hunting involves proactively searching organizational systems, networks, and infrastructure for advanced threats. The objective is to track and disrupt cyber adversaries as early as possible in the attack sequence and to measurably improve the speed and accuracy of organizational responses. Indicators of compromise are forensic artifacts from intrusions that are identified on organizational systems at the host or network level and can include unusual network traffic, unusual file changes, and the presence of malicious code.</p>  <p>Threat hunting teams use existing threat intelligence and may create new threat information, which may be shared with peer organizations, Information Sharing and Analysis Organizations (ISAO), Information Sharing and Analysis Centers (ISAC), and relevant government departments and agencies. Threat indicators, signatures, tactics, techniques, procedures, and other indicators of compromise may be available via government and non- government cooperatives, including Forum of Incident Response and Security Teams, United States Computer Emergency Response Team, Defense Industrial Base Cybersecurity Information Sharing Program, and CERT Coordination Center.</p>  <p>[NIST SP 800-30] provides guidance on threat and risk assessments, risk analyses, and risk modeling. [NIST SP 800-160-2] provides guidance on systems security engineering and cyber resiliency. [NIST SP 800-150] provides guidance on cyber threat information sharing.</p>    <div class="sub-header-1">FURTHER DISCUSSION</div>  <p>For this requirement, threat hunting is conducted on an on-going aperiodic basis. On-going aperiodic refers to activities that happen over and over but without an identifiable repeating pattern over time. For threat hunting, on-going activities take place in an automated manner (e.g., collecting logs, automated analysis, and alerts). Aperiodicity includes humans performing the hunt activities, which take place on an as-needed or as-planned basis.</p>  <p>APTs can penetrate an environment by means that defeat or avoid conventional monitoring methods and alert triggersfor example, by using zero-day attacks. Zero-day attacks become known only after the attack has happened and alerts are sent via threat intelligence feeds based on expert analysis. Because of the nature of zero-day attacks, automated alerts do not generally trigger when the event occurs but the activity is captured in system logs and forwarded for analysis and retention by the SIEM. Threat intelligence information is typically used by hunt teams to search SIEM systems, system event and security logs, and other components to identify activity that has already taken place on an environment. The hunt team will identify systems related to the event(s) and pass the case to Incident Response team for action on the event(s). The hunt team will also use indicators to identify smaller components of an attack and search for that activity, which may help uncover a broader attack on the environment.</p>  <p>Threat hunting can also look for anomalous behavior or activity based on an organizations normal pattern of activity. Understanding the roles and information flows within an organization can help identify activity that might be indicative of adversary behavior before the adversary completes their attack or mission.</p>  <div class="sub-header-2">Example</div>  <p>You are the lead for your organizations cyber threat hunting team. You have local and remote staff on the team to process threat intelligence. Your team is tied closely with the SOC and IR teams. Through a DoD (DC3) intelligence feed, you receive knowledge of a recent APTs attacks on defense contractors. The intelligence feed provided the indicators of compromise for a zero-day attack that most likely started within the past month. After receiving the IOCs, you use a template for your organization to place the information in a standard format your team understands. You then email the information to your team members and place the information in your hunt teams dashboard, which tracks all IOCs [a].</p>  <p>Your team starts by using the information to hunt for IOCs on the environment [b]. One of your team members quickly responds, providing information from the SIEM that an HR systems logs show evidence that IOCs related to this threat occurred three days ago. The team contacts the owner of the system as they take the system offline into a quarantined environment. Your team pulls all logs from the system and clones the storage on the system. Members go through the logs to look for other systems that may be part of the APTs attack [c]. While the team is cloning the storage system for evidence, you alert the IR team about the issue. After full forensics of the system, your team has verified your company has been hit by the APT, but nothing was taken and no additional attacks happened. You also alert DoD (DC3) about the finding and discuss the matter with them. There is an after action report and a briefing given to management to make them aware of the issue.</p>  <div class="sub-header-2">Potential Assessment Considerations</div>  <ul>  <li>Does the organization have a methodology for performing cyber threat hunting actions [b,c]?</li>  <li>Has the organization defined all organizational systems within scope of cyber threat hunting, including valid and approved documentation for any organization systems that are not within scope [b,c]?</li>  <li>Has the organization identified a specific set of individuals to perform cyber threat hunting [b,c]?</li>  <li>Does the threat hunting team have qualified staff members using the threat feed information [b,c]?</li>  <li>Does the threat hunting team use combinations of events to determine suspicious behaviors [b,c]?</li>  <li>Does the organization have a documented list of trusted threat feeds that are used by their cyber hunt teams as the latest indicators of compromise during their efforts [a]?</li>  <li>Does the organization have a clear methodology for processing threat feed information and turning it into actionable information they can use for their threat hunting approach [a]?</li>  </ul>    ' WHERE [Mat_Question_Id] = 5408
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Supplemental_Info]=N'<div class="sub-header-1">ASSESSMENT OBJECTIVES [NIST SP 800-171A]</div>  Determine if:  <ol class="alpha-bracket">  <li>Advanced automation and analytics capabilities to predict and identify risks to organizations, systems, and system components are identified;</li>  <li>Analysts to predict and identify risks to organizations, systems, and system components are identified; and</li>  <li>Advanced automation and analytics capabilities are employed in support of analysts to predict and identify risks to organizations, systems, and system components.</li>  </ol>    <div class="sub-header-1">POTENTIAL ASSESSMENT METHODS AND OBJECTS</div>  <div class="sub-header-2">Examine</div>  <p>[SELECT FROM: System and information integrity policy; risk assessment policy; security planning policy and procedures; procedures addressing organizational assessments of risk; procedures addressing system monitoring; enterprise architecture documentation; system design documentation; system architecture and configuration documentation; system monitoring tools and techniques documentation; system configuration settings and associated documentation; system monitoring logs or records; system audit records; security plan; risk assessment artifacts; risk assessment results; risk assessment reviews; risk assessment updates; other relevant documents or records].</p>  <div class="sub-header-2">Interview</div>  <p>[SELECT FROM: Organizational personnel responsible for information security; organizational personnel responsible for risk assessments; risk analysts; system developers; organizational personnel installing, configuring, and/or maintaining the system; organizational personnel responsible for monitoring; system/network administrators].</p>  <div class="sub-header-2">Test</div>  <p>[SELECT FROM: Automated mechanisms supporting and/or implementing risk analytics capabilities; automated mechanisms supporting and/or implementing system monitoring capability; automated mechanisms supporting and/or implementing the discovery, collection, distribution, and use of indicators of compromise; automated mechanisms for conducting, documenting, reviewing, disseminating, and updating risk assessments].</p>    <div class="sub-header-1">DISCUSSION</div>  <p>A properly resourced Security Operations Center (SOC) or Computer Incident Response Team (CIRT) may be overwhelmed by the volume of information generated by the proliferation of security tools and appliances unless it employs advanced automation and analytics to analyze the data. Advanced automation and predictive analytics capabilities are typically supported by artificial intelligence concepts and machine learning. Examples include Automated Workflow Operations, Automated Threat Discovery and Response (which includes broad-based collection, context-based analysis, and adaptive response capabilities), and machine-assisted decision tools.</p>  <p>[NIST SP 800-30] provides guidance on risk assessments and risk analyses.</p>    <div class="sub-header-1">FURTHER DISCUSSION</div>  <p>Advanced automation includes tools to correlate and reduce the cyber data overload created by defensive tools, making the data understandable to the analyst. Automation also allows the defensive mechanisms to respond rapidly when adversary events are identified. Examples of such capabilities are SIEM; Security Orchestration, Automation, and Response (SOAR); and Extended Detection and Response (XDR) tools. An example of an automated rapid response action is a security alert being pushed to the SIEM while the organizations SOAR solution communicates to the network firewall to block communications to the remote system identified in the security alert.</p>  <p>SIEM is primarily a log collection tool intended to support data storage and analysis. It collects and sends alerts to security personnel for further investigation. SOAR is a software stack that enables an organization to collect data about security threats and respond to security events without human assistance in order to improve security operations. Orchestration connects and integrates disparate internal and external tools. Automation, fed by the data and alerts collected from security orchestration, ingests and analyzes data and creates repeated, automated responses. SOAR incorporates these capabilities based on the SIEM data and enables disparate security tools to coordinate with one another. SOAR can use artificial intelligence to predict and respond to similar future threats, if such tools are employed.</p>  <p>XDR streamlines security data ingestion, analysis, prevention, and remediation workflows across an organizations entire security stack, providing a single console to view and act on threat data. However, the presence of these tools by themselves does not necessarily provide an advanced capability. It is essential that the security team employ critical thinking in support of the intrusion detection and threat hunting processes.</p>  <div class="sub-header-2">Example</div>  <p>You are responsible for information security in your organization. The organization holds and processes CUI in an enterprise. To protect that data, you want to minimize phishing attacks through the use of Security Orchestration and Automated Response (SOAR). Rather than relying on analysts to manually inspect each inbound item, emails containing links and/or attachments are processed by your automation playbook. Implementation of these processes involves sending all email links and attachments to detonation chambers or sandboxes prior to delivery to the recipient. When the email is received, SOAR extracts all URL links and attachments from the content and sends them for analysis and testing [a]. The domains in the URLs and the full URLs are processed against bad domain and URL lists. Next, a browser in a sandbox downloads the URLs for malware testing. Lastly, any attachments are sent to detonation chambers to identify if they attempt malicious activities. The hash of the attachments is sent to services to identify if it is known malware [b]. If any one of the items triggers a malware warning from the sandbox, detonation chamber, domain/URL validation service, attachment hash check services, or AV software, an alert about the original email is sent to team members with the recommendation to quarantine it. The team is given the opportunity to select a take action button, which would have the SOAR solution take actions to block that email and similar emails from being received by the organization [c].</p>  <div class="sub-header-2">Potential Assessment Considerations</div>  <ul>  <li>Has the organization implemented a security information and event management system [a,c]?</li>  <li>Has the organization implemented security orchestration, automation, and response tools [a,b,c]?</li>  <li>Does the organization use automated processing integrated with the SIEM system to perform analytics [c]?</li>  <li>Can the organization demonstrate use of relevant threat data to inform detection methods that in turn provide automated alerts/recommendations [c]?</li>  <li>Has the organization implemented an extended detection capability [c]?</li>  <li>Does the organization have the ability to merge traditional cyber data, such as network packet captures (e.g., PCAP), or process logs with enrichment data, such as reputation or categorization data [c]?</li>  <li>Can the organization provide examples of both basic and emerging analytics used to analyze alert anomalies, e.g., both simple queries and unsupervised machine learning algorithms that both improve their effectiveness and automatically filter, reduce, or enrich alerting capabilities [c]?</li>  </ul>    ' WHERE [Mat_Question_Id] = 5409
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Supplemental_Info]=N'<div class="sub-header-1">ASSESSMENT OBJECTIVES [NIST SP 800-171A]</div>  Determine if:  <ol class="alpha-bracket">  <li>The system security plan documents or references the security solution selected;</li>  <li>The system security plan documents or references the rationale for the security solution; and</li>  <li>The system security plan documents or references the risk determination.</li>  </ol>    <div class="sub-header-1">POTENTIAL ASSESSMENT METHODS AND OBJECTS</div>  <div class="sub-header-2">Examine</div>  <p>[SELECT FROM: system security plan; records of security plan reviews and updates; system design documentation; security planning policy; procedures addressing security plan development; procedures addressing security plan reviews and updates; enterprise architecture documentation; enterprise security architecture documentation; system interconnection security agreements and other information exchange agreements; other relevant documents or records].</p>  <div class="sub-header-2">Interview</div>  <p>[SELECT FROM: Organizational personnel responsible for information security; organizational personnel responsible for developing, implementing, or approving system interconnection and information exchange agreements; personnel managing the systems to which the Interconnection Security Agreement/Information Exchange Agreement applies; system developers; organizational personnel responsible for security planning and plan implementation; organizational personnel responsible for boundary protection; system developers; system/network administrators].</p>  <div class="sub-header-2">Test</div>  <p>[SELECT FROM: Organizational processes for security plan development, review, update, and approval].</p>    <div class="sub-header-1">DISCUSSION</div>  <p>System security plans relate security requirements to a set of security controls and solutions. The plans describe how the controls and solutions meet the security requirements. For the enhanced security requirements selected when the APT is a concern, the security plan provides traceability between threat and risk assessments and the risk-based selection of a security solution, including discussion of relevant analyses of alternatives and rationale for key security-relevant architectural and design decisions. This level of detail is important as the threat changes, requiring reassessment of the risk and the basis for previous security decisions.</p>  <p>When incorporating external service providers into the system security plan, organizations state the type of service provided (e.g., software as a service, platform as a service), the point and type of connections (including ports and protocols), the nature and type of the information flows to and from the service provider, and the security controls implemented by the service provider. For safety critical systems, organizations document situations for which safety is the primary reason for not implementing a security solution (i.e., the solution is appropriate to address the threat but causes a safety concern).</p>  <p>[NIST SP 800-18] provides guidance on the development of system security plans.</p>    <div class="sub-header-1">FURTHER DISCUSSION</div>  <p>The System Security Plan (SSP) is a fundamental component of an organizations security posture. When solutions for implementing a requirement have differing levels of capabilities associated with their implementation, it is essential that the plan specifically document the rationale for the selected solution and what was acquired for the implementation. This information allows the organization to monitor the environment for threat changes and identify which solutions may no longer be applicable. While not required, it may also be useful to document alternative solutions reviewed and differing levels of risk associated with each alternative, as that information may facilitate future analyses when the threat changes. In addition to the implementations required for Level 2 certification, which may not be risk based, at Level 3, the SSP must carefully document the link between the assessed threat and the risk-based selection of a security solution for the enhanced security requirements (i.e., all CMMC L3 requirements derived from NIST SP 800-172).</p>  <div class="sub-header-2">Example</div>  <p>You are responsible for information security in your organization. Following CMMC requirement RA.L3-3.11.1e  Threat Informed Risk Assessment, your team uses threat intelligence to complete a risk assessment and make a risk determination for all elements of your enterprise. Based on that view of risk, your team decides that requirement RA.L3-3.11.2e  Threat Hunting is a requirement that is very important in protecting your organizations use of CUI, and you have determined the solution selected could potentially add risk. You want to detect an adversary as soon as possible when they breach the network before any CUI can be exfiltrated. However, there are multiple threat hunting solutions, and each solution has a different set of features that will provide different success rates in identifying IOCs.</p>  <p>As a result, some solutions increase the risk to the organization by being less capable in detecting and tracking an adversary in your networks. To reduce risk, you evaluate five threat hunting solutions and in each case determine the number of IOCs for which there is a monitoring mechanism. You pick the solution that is cost effective, easy to operate, and optimizes IOC detection for your enterprise; purchase, install, and train SOC personnel on its use; and document the risk-based analysis of alternatives in the SSP. In creating that documentation in the SSP, you follow the guidance found in NIST SP 800-18, Guide for Developing Security Plans for Federal Information Systems [a,b,c].</p>  <div class="sub-header-2">Potential Assessment Considerations</div>  <ul>  <li>Has the organization completed a risk assessment and made a risk determinations for enterprise components that need to be protected [c]?</li>  <li>Can the organization identify what is being protected and explain why specific protection solutions were selected [a,b]?</li>  <li>Have all the decisions been documented in the SSP [a,b,c]?</li>  </ul>    ' WHERE [Mat_Question_Id] = 5410
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Supplemental_Info]=N'<div class="sub-header-1">ASSESSMENT OBJECTIVES [NIST SP 800-171A]</div>  Determine if:  <ol class="alpha-bracket">  <li>Supply chain risks associated with organizational systems and system components are identified;</li>  <li>Supply chain risks associated with organizational systems and system components are assessed;</li>  <li>Supply chain risks associated with organizational systems and system components are responded to; and</li>  <li>Supply chain risks associated with organizational systems and system components are monitored.</li>  </ol>    <div class="sub-header-1">POTENTIAL ASSESSMENT METHODS AND OBJECTS</div>  <div class="sub-header-2">Examine</div>  <p>[SELECT FROM: Risk assessment policy; procedures addressing organizational assessments of risk; security planning policy and procedures; supply chain risk management plan; security plan; risk assessment; risk assessment results; risk assessment reviews; risk assessment updates; threat intelligence information; other relevant documents or records].</p>  <div class="sub-header-2">Interview</div>  <p>[SELECT FROM: Organizational personnel responsible for information security; organizational personnel responsible for risk assessments; organizational personnel responsible for supply chain risk management].</p>  <div class="sub-header-2">Test</div>  <p>[SELECT FROM: Mechanisms supporting, conducting, documenting, reviewing, disseminating, and updating risk assessments].</p>    <div class="sub-header-1">DISCUSSION</div>  <p>Supply chain events include disruption, use of defective components, insertion of counterfeits, theft, malicious development practices, improper delivery practices, and insertion of malicious code. These events can have a significant impact on a system and its information and, therefore, can also adversely impact organizational operations (i.e., mission, functions, image, or reputation), organizational assets, individuals, other organizations, and the Nation. The supply chain-related events may be unintentional or malicious and can occur at any point during the system life cycle. An analysis of supply chain risk can help an organization identify systems or components for which additional supply chain risk mitigations are required.</p>  <p>[NIST SP 800-30] provides guidance on risk assessments, threat assessments, and risk analyses. [NIST SP 800-161 Rev. 1] provides guidance on supply chain risk management.</p>    <div class="sub-header-1">FURTHER DISCUSSION</div>  <p>Organizations will have varying policies, definitions, and actions for this requirement. It is important for a single organization to be consistent and to build a process that makes sense for their organization, strategy, unique supply chain, and the technologies available to them.</p>  <div class="sub-header-2">Example</div>  <p>You are responsible for information security in your organization, which holds and processes CUI. One of your responsibilities is to manage risk associated with your supply chain that may provide an entry point for the adversary. First, you acquire threat information by subscribing to reports that identify supply chain attacks in enough detail that you are able to identify the risk points in your organizations supply chain [a]. You create an organization- defined prioritized list of risks the organization may encounter and determine the responses to be implemented to mitigate those risks [b,c].</p>  <p>In addition to incident information, the intelligence provider also makes recommendations for monitoring and auditing your supply chain. You assess, integrate, correlate, and analyze this information so you can use it to acquire monitoring tools to help identify supply chain events that could be an indicator of an incident. This monitoring tool provides visibility of the entire attack surface, including your vendors security posture [d]. Second, you analyze the incident information in the intelligence report to help identify defensive tools that will help respond to each of those known supply chain attack techniques as soon as possible after such an incident is detected, thus mitigating risk associated with known techniques.</p>  <div class="sub-header-2">Potential Assessment Considerations</div>  <ul>  <li>Has the organization prioritized risks to the supply chain [a,b]?</li>  <li>Does the organization have viable service-level agreements that describe and enable responses to supply chain incidents [c,d]?</li>  </ul>    ' WHERE [Mat_Question_Id] = 5412
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Supplemental_Info]=N'<div class="sub-header-1">ASSESSMENT OBJECTIVES [NIST SP 800-171A]</div>  Determine if:  <ol class="alpha-bracket">  <li>Supply chain risks associated with organizational systems and system components are identified;</li>  <li>Organizational systems and system components to include in a supply chain risk management plan are identified;</li>  <li>A plan for managing supply chain risks associated with organizational systems and system components is developed; and</li>  <li>The plan for managing supply chain risks is updated at least annually, and upon receipt of relevant cyber threat information, or in response to a relevant cyber incident.</li>  </ol>    <div class="sub-header-1">POTENTIAL ASSESSMENT METHODS AND OBJECTS</div>  <div class="sub-header-2">Examine</div>  <p>[SELECT FROM: Risk assessment policy; supply chain risk management plan; security planning policy and procedures; procedures addressing organizational assessments of risk; security plan; risk assessment; risk assessment results; risk assessment reviews; risk assessment updates; threat intelligence information; other relevant documents or records].</p>  <div class="sub-header-2">Interview</div>  <p>[SELECT FROM: Organizational personnel responsible for information security; organizational personnel responsible for risk assessments; organizational personnel responsible for supply chain risk management].</p>  <div class="sub-header-2">Test</div>  <p>[SELECT FROM: Automated mechanisms supporting, conducting, documenting, reviewing, disseminating, and updating risk assessments].</p>    <div class="sub-header-1">DISCUSSION</div>  <p>The growing dependence on products, systems, and services from external providers, along with the nature of the relationships with those providers, present an increasing level of risk to an organization. Threat actions that may increase risk include the insertion or use of counterfeits, unauthorized production, tampering, theft, insertion of malicious software and hardware, and poor manufacturing and development practices in the supply chain. Supply chain risks can be endemic or systemic within a system element or component, a system, an organization, a sector, or the Nation. Managing supply chain risk is a multifaceted undertaking that requires a coordinated effort across an organization to build trust relationships and communicate with both internal and external stakeholders. Supply chain risk management (SCRM) activities involve identifying and assessing risks, determining appropriate mitigating actions, developing SCRM plans to document selected mitigating actions, and monitoring performance against plans. SCRM plans address requirements for developing trustworthy, secure, and resilient systems and system components, including the application of the security design principles implemented as part of life cycle-based systems security engineering processes.</p>  <p>[NIST SP 800-161 Rev. 1] provides guidance on supply chain risk management.</p>    <div class="sub-header-1">FURTHER DISCUSSION</div>  <p>An organization is required to have a supply chain risk management plan that assesses and responds to the identified risks from those organizations that provide IT products or services, including any cloud or other third-party services with a role in the operation of the system. The organization should be cognizant of services outside the scope of the system but required for the operation of the system as part of their plan. Since the cyber environment changes rapidly and continuously, it is equally important for the organization to update the plan in response to supply chain cyber incidents or emerging information.</p>  <div class="sub-header-2">Example</div>  <p>You are responsible for information security in your organization, and you have created a supply chain risk management plan [a,b,c]. One of the organizations suppliers determines that it has been the victim of a cyberattack. Your security team meets with the supplier to determine the nature of the attack and to understand the adversary, the attack, the potential for corruption of delivered goods or services, and current as well as future risks. The understanding of the supply chain will help protect the local environment. Subsequently, you update the risk management plan to include a description of the necessary configuration changes or upgrades to monitoring tools to improve the ability to identify the new risks, and when improved tools are available, you document the acquisition of defensive tools and associated functionality to help mitigate any of the identified techniques [d].</p>  <div class="sub-header-2">Potential Assessment Considerations</div>  <ul>  <li>Does the organizations current supply chain risk management plan apply across the enterprise, or does it only apply to a limited portion of the supply chain [b]?</li>  </ul>' WHERE [Mat_Question_Id] = 5413
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Supplemental_Info]=N'<div class="sub-header-1">ASSESSMENT OBJECTIVES [NIST SP 800-171A]</div>  Determine if:  <ol class="alpha-bracket">  <li>Automated scanning tools are identified;</li>  <li>Ad hoc tests using subject matter experts are identified; and</li>  <li>Penetration testing is conducted at least annually or when significant security changes are made to the system, leveraging automated scanning tools and ad hoc tests using subject matter experts.</li>  </ol>    <div class="sub-header-1">POTENTIAL ASSESSMENT METHODS AND OBJECTS</div>  <div class="sub-header-2">Examine</div>  <p>[SELECT FROM: Security assessment policy; procedures addressing penetration testing; security plan; security assessment plan; penetration test report; security assessment report; security assessment evidence; other relevant documents or records].</p>  <div class="sub-header-2">Interview</div>  <p>[SELECT FROM: Organizational personnel responsible for security assessments; penetration testing team; system/network administrators; organizational personnel responsible for information security].</p>  <div class="sub-header-2">Test</div>  <p>[SELECT FROM: Automated mechanisms supporting security assessments; automated mechanisms supporting penetration testing].</p>    <div class="sub-header-1">DISCUSSION</div>  <p>Penetration testing is a specialized type of assessment conducted on systems or individual system components to identify vulnerabilities that could be exploited by adversaries. Penetration testing goes beyond automated vulnerability scanning. It is conducted by penetration testing agents and teams with particular skills and experience that include technical expertise in network, operating system, and application-level security. Penetration testing can be used to validate vulnerabilities or determine a systems penetration resistance to adversaries within specified constraints. Such constraints include time, resources, and skills. Organizations may also supplement penetration testing with red team exercises. Red teams attempt to duplicate the actions of adversaries in carrying out attacks against organizations and provide an in-depth analysis of security-related weaknesses or deficiencies.</p>  <p>Organizations can use the results of vulnerability analyses to support penetration testing activities. Penetration testing can be conducted internally or externally on the hardware, software, or firmware components of a system and can exercise both physical and technical controls. A standard method for penetration testing includes pretest analysis based on full knowledge of the system, pretest identification of potential vulnerabilities based on the pretest analysis, and testing designed to determine the exploitability of vulnerabilities. All parties agree to the specified rules of engagement before the commencement of penetration testing. Organizations correlate the rules of engagement for penetration tests and red teaming exercises (if used) with the tools, techniques, and procedures that they anticipate adversaries may employ. The penetration testing or red team exercises may be organization- based or external to the organization. In either case, it is important that the team possesses the necessary skills and resources to do the job and is objective in its assessment.</p>  <p>[NIST SP 800-53A] provides guidance on conducting security assessments.</p>    <div class="sub-header-1">FURTHER DISCUSSION</div>  <p>It is important that the organization has a repeatable penetration testing capability, regardless of who performs the penetration testing. This requirement entails performing tests against components of the organizations architecture to identify cyber weaknesses and vulnerabilities. It does not mean everything in the architecture requires penetration testing. This requirement provides findings and mitigation strategies that benefit the organization and help create a stronger environment against adversary efforts. It may be beneficial for the organization to define the scope of penetration testing. The organizations approach may involve hiring an expert penetration testing team to perform testing on behalf of the organization. When an organization has penetration testing performed, either by an internal team or external firm, they should establish rules of engagement and impose limits on what can be performed by the penetration test team(s).</p>  <p>Ensuring the objectivity of the test team is important as well. Potential conflicts of interest, such as having internal testers report directly or indirectly to network defenders or an external test team contracted by network defense leadership, must be carefully managed by organizational leadership.</p>  <p>Reports on the findings should be used by the organization to determine where to focus funding, staffing, training, or technical improvements for future mitigation strategies.</p>  <div class="sub-header-2">Example</div>  <p>You are responsible for information security in your organization. Leveraging a contract managed by the CIO, you hire an external expert penetration team annually to test the security of the organizations enclave that stores and processes CUI [a,c]. You hire the same firm annually or on an ad hoc basis when significant changes are made to the architecture or components that affect security [b,c].</p>  <div class="sub-header-2">Potential Assessment Considerations</div>  <ul>  <li>Does the organization have internal team members who possess the proper level of expertise to perform a valued penetration testing effort [b]?</li>  <li>If the penetration testing is performed by an internal team, are the individuals performing the testing objectively [b]?</li>  <li>Is a penetration testing final report provided to the internal team responsible for organizational defense?</li>  <li>If previous penetration tests have been conducted, can the organization provide samples of penetration test plans, findings reports, and mitigation guidance based on the findings [a,b,c]?</li>  </ul>    ' WHERE [Mat_Question_Id] = 5414
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Supplemental_Info]=N'<div class="sub-header-1">ASSESSMENT OBJECTIVES [NIST SP 800-171A]</div>  Determine if:  <div>[ODP1] One or more of the following is/are selected: physical isolation techniques; logical isolation techniques;</div>  <div>[ODP2] Physical isolation techniques are defined (if selected); </div> <div>[ODP3] Logical isolation techniques are defined (if selected);</div> <ol class="alpha-bracket"> <li>Physical isolation techniques or logical isolation techniques or both are employed in organizational systems and system components.</li>  </ol>    <div class="sub-header-1">POTENTIAL ASSESSMENT METHODS AND OBJECTS</div>  <div class="sub-header-2">Examine</div>  <p>[SELECT FROM: System and communications protection policy; procedures addressing boundary protection; system design documentation; procedures addressing the use of thin nodes; list of key internal boundaries of the system; security plan; boundary protection hardware and software; system configuration settings and associated documentation; enterprise architecture documentation; system architecture; security architecture documentation; system audit records; system component inventory; list of security tools and support components to be isolated from other system components; other relevant documents or records].</p>  <div class="sub-header-2">Interview</div>  <p>[SELECT FROM: Organizational personnel responsible for information security; system/network administrators; system developers; organizational personnel responsible for boundary protection].</p>  <div class="sub-header-2">Test</div>  <p>[SELECT FROM: Mechanisms implementing the boundary protection capability; mechanisms implementing physical isolation techniques; mechanisms supporting and/or implementing the isolation of information security tools, mechanisms, and support components; mechanisms supporting and/or implementing the capability to separate system components supporting organizational missions and business functions; mechanisms implementing logical isolation techniques; mechanisms supporting or implementing separate network addresses/different subnets; mechanisms supporting and/or implementing thin nodes].</p>    <div class="sub-header-1">DISCUSSION</div>  <p>A mix of physical and logical isolation techniques (described below) implemented as part of the system architecture can limit the unauthorized flow of CUI, reduce the system attack surface, constrain the number of system components that must be secure, and impede the movement of an adversary. When implemented with a set of managed interfaces, physical and logical isolation techniques for organizational systems and components can isolate CUI into separate security domains where additional protections can be implemented. Any communications across the managed interfaces (i.e., across security domains), including for management or administrative purposes, constitutes remote access even if the communications remain within the organization. Separating system components with boundary protection mechanisms allows for the increased protection of individual components and more effective control of information flows between those components. This enhanced protection limits the potential harm from and susceptibility to hostile cyber- attacks and errors. The degree of isolation can vary depending on the boundary protection mechanisms selected. Boundary protection mechanisms include routers, gateways, and firewalls separating system components into physically separate networks or subnetworks; virtualization and micro-virtualization techniques; encrypting information flows among system components using distinct encryption keys; cross-domain devices separating subnetworks; and complete physical separation (i.e., air gaps).</p>  <p>System architectures include logical isolation, partial physical and logical isolation, or complete physical isolation between subsystems and at system boundaries between resources that store, process, transmit, or protect CUI and other resources. Examples include:</p>  

<ul>
<li>Logical isolation: Data tagging, digital rights management (DRM), and data loss prevention (DLP) that tags, monitors, and restricts the flow of CUI; virtual machines or containers that separate CUI and other information on hosts; and virtual local area networks (VLAN) that keep CUI and other information separate on networks.</li>  
<li>Partial physical and logical isolation: Physically or cryptographically isolated networks, dedicated hardware in data centers, and secure clients that (a) may not directly access resources outside of the domain (i.e., all applications with cross-enclave connectivity execute as remote virtual applications hosted in a demilitarized zone [DMZ] or internal and protected enclave), (b) access via remote virtualized applications or virtual desktop with no file transfer capability other than with dual authorization, or (c) employ dedicated client hardware (e.g., a zero or thin client) or hardware approved for multi- level secure (MLS) usage.</li>  
<li>Complete physical isolation: Dedicated (not shared) client and server hardware; physically isolated, stand-alone enclaves for clients and servers; and (a) logically separate network traffic (e.g., using a VLAN) with end-to-end encryption using Public Key Infrastructure (PKI)-based cryptography or (b) physical isolation from other networks.</li>  
</ul>

<p>Isolation techniques are selected based on a risk management perspective that balances the threat, the information being protected, and the cost of the options for protection. Architectural and design decisions are guided and informed by the security requirements and selected solutions. Organizations consider the trustworthiness of the isolation techniques employed (e.g., the logical isolation relies on information technology that could be considered a high value target because of the function being performed), introducing its own set of vulnerabilities.</p>  <p>[NIST SP 800-160-1] provides guidance on developing trustworthy, secure, and cyber resilient systems using systems security engineering practices and security design concepts.</p>    <div class="sub-header-1">FURTHER DISCUSSION</div>  <p>For this requirement, organizations must identify the systems or enclaves that need to be isolated, then design and implement the isolation. The resulting isolation solutions are documented or referenced in the SSP. Documentation will be dependent on the design selected and may include a high-level diagram, but specific details that may change on some frequency would be omitted. During an assessment, providing details such as subnet and VLAN implementation identifiers, internal boundary protection hardware and software, interface device functionality, and system configuration and Access Control List (ACL) settings will be useful.</p>  <div class="sub-header-2">Example</div>  <p>You are responsible for information security in your organization, which holds and processes CUI. You have decided to isolate the systems processing CUI by limiting all communications in and out that enclave with cross-domain interface devices that implement access control [a]. Your security team has identified all the systems containing such CUI, documented network design details, developed network diagrams showing access control points, documented the logic for the access control enforcement decisions, described the interface and protocol to the identification and authentication mechanisms, and documented all details associated with the ACLs, including review, updates, and credential revocation procedures.</p>  <div class="sub-header-2">Potential Assessment Considerations</div>  <ul>  <li>Has the organization clearly identified where they use physical, logical, or both isolation techniques [a]?</li>  <li>Can the organization describe the isolation techniques they have employed [a]?</li>  <li>Has the organization deployed subnetting, internal firewalls, and VLANs to control packet flow between internal segments [a]?</li>  <li>Does the organization employ metadata to inform isolation techniques [a]?</li>  </ul>    ' WHERE [Mat_Question_Id] = 5415
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Supplemental_Info]=N'<div class="sub-header-1">ASSESSMENT OBJECTIVES [NIST SP 800-171A]</div>  Determine if:  <div>[ODP1] Security critical or essential software is defined;</div> <ol class="alpha-bracket"> <li>Root of trust mechanisms or cryptographic signatures are identified; and</li>  <li>The integrity of security critical and essential software is verified using root of trust mechanisms or cryptographic signatures.</li>  </ol>    <div class="sub-header-1">POTENTIAL ASSESSMENT METHODS AND OBJECTS</div>  <div class="sub-header-2">Examine</div>  <p>[SELECT FROM: System and information integrity policy; procedures addressing software, firmware, and information integrity; system design documentation; security plan; system configuration settings and associated documentation; system component inventory; integrity verification tools and associated documentation; records of integrity verification scans; system audit records; cryptographic mechanisms and associated documentation; records of detected unauthorized changes to software, firmware, and information; other relevant documents or records].</p>  <div class="sub-header-2">Interview</div>  <p>[SELECT FROM: Organizational personnel responsible for information security; organizational personnel responsible for software, firmware, and/or information integrity; system developers; system/network administrators].</p>  <div class="sub-header-2">Test</div>  <p>[SELECT FROM: Software, firmware, and information integrity verification tools; mechanisms supporting and/or implementing integrity verification of the boot process; mechanisms supporting and/or implementing protection of the integrity of boot firmware; cryptographic mechanisms implementing software, firmware, and information integrity; safeguards implementing protection of the integrity of boot firmware].</p>    <div class="sub-header-1">DISCUSSION</div>  <p>Verifying the integrity of the organizations security-critical or essential software is an important capability since corrupted software is the primary attack vector used by adversaries to undermine or disrupt the proper functioning of organizational systems. There are many ways to verify software integrity throughout the system development life cycle. Root of trust mechanisms (e.g., secure boot, trusted platform modules, Unified Extensible Firmware Interface [UEFI]), verify that only trusted code is executed during boot processes. This capability helps system components protect the integrity of boot firmware in organizational systems by verifying the integrity and authenticity of updates to the firmware prior to applying changes to the system component and preventing unauthorized processes from modifying the boot firmware. The employment of cryptographic signatures ensures the integrity and authenticity of critical and essential software that stores, processes, or transmits, CUI. Cryptographic signatures include digital signatures and the computation and application of signed hashes using asymmetric cryptography, protecting the confidentiality of the key used to generate the hash, and using the public key to verify the hash information. Hardware roots of trust are considered to be more secure. This requirement supports 3.4.1e and 3.4.3.e.</p>  <p>[FIPS 140-3] provides security requirements for cryptographic modules. [FIPS 180-4] and [FIPS 202] provide secure hash standards. [FIPS 186-4] provides a digital signature standard. [NIST SP 800-147] provides BIOS protection guidance. [NIST TRUST] provides guidance on the roots of trust project.</p>    <div class="sub-header-1">FURTHER DISCUSSION</div>  <p>Organizations verify the integrity of security critical and essential software every time that software is executed. Secure boot mechanisms for firmware and a cryptographically protected boot chain ensure the integrity of the operating system (OS) and security critical software, and cryptographic techniques ensure the essential software has not been tampered with after development prior to execution. If software is itself considered to be CUI or if it uses CUI, this requirement ensures it has not been compromised.</p>  <p>Software and information integrity verification tools can help check the integrity during the development process for those organizations developing software. As critical software is updated, the integrity of any configuration data and the software must result in updated signatures and an ongoing verification process.</p>  <p>Operating systems include mechanisms to validate digital signatures for installed software. Most software packages use signatures to prove the integrity of the provided software, and the organization should leverage these capabilities. Similarly, most hardware appliance vendors have secure boot checks in place for their devices and built-in features that check the digital signature of an upgrade/update package before they allow an upgrade to take place. For locally developed software, the organization should sign the software to ensure its integrity.</p>  <div class="sub-header-2">Example 1</div>  <p>You are responsible for information security in your organization. Your security team has identified the software used to process CUI, and the organization has decided it is mission- critical software that must be protected. You take three actions. First, you ensure all of the platforms configuration information used at boot is hashed and stored in a TPM [a]. Second, you ensure that the platforms used to execute the software are started with a digitally signed software chain to a secure boot process using the TPM. Finally, you ensure the essential applications are cryptographically protected with a digital signature when stored and the signature is verified prior to execution [b].</p>  <div class="sub-header-2">Example 2</div>  <p>Your organization has a software security team, and they are required to validate unsigned essential software provided to systems that do not have TPM modules. The organization has a policy stating no software can be executed on a system unless its hash value matches that of a hash stored in the approved software library kept by the software security team [a]. This action is performed by implementing software restriction policies on systems. The team tests the software on a sandbox system, and once it is proven safe, they run a hashing function on the software to create a hash value. This hash value is placed in a software library so the system will know it can execute the software [b]. Any changes to the software without the software security teams approval will result in the software failing the security tests, and it will be prevented from executing.</p>  <div class="sub-header-2">Potential Assessment Considerations</div>  <ul>  <li>Does the organization use cryptographic signatures to ensure the integrity and authenticity of critical and essential software and data [b]?</li>  <li>Has the organization identified those devices that require integrity verification of the boot process [a]?</li>  <li>Does the organization use a TPM to store hashes of pre-run time configuration parameters for those systems [b]?</li>  <li>Does the organization leverage the TPM configuration hash to verify the hardware and software configuration is unchanged in order to determine that a system is trustworthy before running mission-essential applications [b,c]?</li>  <li>Does the organization use the TPM for remote attestation to determine to which extent information can be trusted from another system [b,c]?</li>  <li>Has the organization identified devices requiring organization-defined security safeguards that must be implemented to protect the integrity of boot firmware [a]?</li>  <li>Has the organization defined security safeguards that will be implemented to protect the integrity of boot firmware in mission-essential devices [a]?</li>  <li>Has the organization implemented organization-defined security safeguards to protect the integrity of boot firmware in organization-defined essential devices [b]?</li>  </ul>    ' WHERE [Mat_Question_Id] = 5416
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Supplemental_Info]=N'<div class="sub-header-1">ASSESSMENT OBJECTIVES [NIST SP 800-171A]</div>  Determine if:  <ol class="alpha-bracket">  <li>Specialized assets including IoT, IIoT, OT, GFE, Restricted Information Systems and test equipment are included in the scope of the specified enhanced security requirements; and</li>  <li>Systems and system components that are not included in specialized assets including IoT, IIoT, OT, GFE, Restricted Information Systems and test equipment are segregated in purpose-specific networks.</li>  </ol>    <div class="sub-header-1">POTENTIAL ASSESSMENT METHODS AND OBJECTS</div>  <div class="sub-header-2">Examine</div>  <p>[SELECT FROM: Access control policy; information flow control policies; system and services acquisition policy; system and communications protection policy; procedures addressing security function isolation; procedures addressing application partitioning; procedures addressing security engineering principles used in the specification, design, development, implementation, and modification of the system; procedures addressing information flow enforcement; procedures addressing access enforcement; system architecture; system design documentation; security plan; system component inventory; system configuration settings and associated documentation; system baseline configuration; list of security functions to be isolated from non-security functions; system audit records; security requirements and specifications for the system; list of approved authorizations (user privileges); list of information flow authorizations; other relevant documents or records].</p>  <div class="sub-header-2">Interview</div>  <p>[SELECT FROM: Organizational personnel responsible for access enforcement; system/network administrators; organizational personnel responsible for information security; system developers; system integrators; organizational personnel responsible for acquisition/contracting; organizational personnel responsible for determining system security requirements; system security architects; enterprise architects; organizational personnel responsible for system specification, design, development, implementation, and modification].</p>  <div class="sub-header-2">Test</div>  <p>[SELECT FROM: Mechanisms implementing the access control policy; mechanisms implementing the information flow enforcement policy; mechanisms supporting the application of security engineering principles in system specification, design, development, implementation, and modification].</p>    <div class="sub-header-1">DISCUSSION</div>  <p>Organizations may have a variety of systems and system components in their inventory, including Information Technology (IT), Internet of Things (IoT), Operational Technology (OT), and Industrial Internet of Things (IIoT). The convergence of IT, OT, IoT, and IIoT significantly increases the attack surface of organizations and provides attack vectors that are challenging to address. Compromised IoT, OT, and IIoT system components can serve as launching points for attacks on organizational IT systems that handle CUI. Some IoT, OT, and IIoT system components can store, transmit, or process CUI (e.g., specifications or parameters for objects manufactured in support of critical programs). Most of the current generation of IoT, OT, and IIoT system components are not designed with security as a foundational property and may not be able to be configured to support security functionality. Connections to and from such system components are generally not encrypted, do not provide the necessary authentication, are not monitored, and are not logged. Therefore, these components pose a significant cyber threat. Gaps in IoT, OT, and IIoT security capabilities may be addressed by employing intermediary system components that can provide encryption, authentication, security scanning, and logging capabilitiesthus, preventing the components from being accessible from the Internet. However, such mitigation options are not always available or practicable. The situation is further complicated because some of the IoT, OT, and IIoT devices may be needed for essential missions and business functions. In those instances, it is necessary for such devices to be isolated from the Internet to reduce the susceptibility to cyber-attacks.</p>  <p>[NIST SP 800-160-1] provides guidance on security engineering practices and security design concepts.</p>    <div class="sub-header-1">FURTHER DISCUSSION</div>  <p>Specialized Assets are addressed in the scoping guidance, which should be overlaid on this requirement. The OSC must document Specialized Assets in the asset inventory; develop, document, and periodically update system security plans; and include Specialized Assets in the network diagram. The Specialized Asset section of the SSP should describe associated system boundaries, system environments of operation, how security requirements are implemented, and the relationships with or connections to other systems.</p>  <p>Specialized Assets within the Level 3 CMMC assessment scope must be either assessed against all CMMC security requirements or separated into purpose-specific networks. Specialized Assets may have limitations on the application of certain security requirements. To accommodate such issues, the SSP should describe any mitigations.</p>  <p>Intermediary devices are permitted to mitigate an inability for the asset itself to implement one or more CMMC requirements. An example of an intermediary device used in conjunction with a specialized asset is a boundary device or a proxy.</p>  <p>The high-level list of Specialized Assets includes:</p>  <ul>  <li>Government Furnished Equipment;</li>  <li>IoT and IIoT devices (physical or virtual) with sensing/actuation capability and programmability features;</li>  <li>OT used in manufacturing systems, industrial control systems (ICS), or supervisory control and data acquisition (SCADA) systems;</li>  <li>Restricted Information Systems, which can include systems and IT components that are configured based on government requirements; and</li>  <li>Test equipment.</li>  </ul>  <div class="sub-header-2">Example</div>  <p>You are responsible for information security in your organization, which processes CUI on the network, and this same network includes GFE for which the configuration is mandated by the government. The GFE is needed to process CUI information [a]. Because the company cannot manage the configuration of the GFE, it has been augmented by placing a bastion host between it and the network. The bastion host meets the requirements that the GFE cannot, and is used to send CUI files to and from the GFE for processing. You and your security team document in the SSP all of the GFE to include GFE connectivity diagrams, a description of the isolation mechanism, and a description of how your organization manages risk associated with that GFE [a].</p>  <div class="sub-header-2">Potential Assessment Considerations</div>  <ul>  <li>Has the organization documented all specialized assets in asset inventory [a]?</li>  <li>Has the organization documented all specialized assets in the SSP to show how risk is managed [b]?</li>  <li>Has the organization provided a network diagram for specialized assets [a,b]?</li>  </ul>    ' WHERE [Mat_Question_Id] = 5417
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Supplemental_Info]=N'<div class="sub-header-1">ASSESSMENT OBJECTIVES [NIST SP 800-171A]</div>  Determine if:  <div>[ODP1] External organizations from which to obtain threat indicator information and effective mitigations are defined;</div><ol class="alpha-bracket">  <li>Threat indicator information is identified;</li>  <li>Effective mitigations are identified;</li>  <li>Intrusion detection approaches are identified;</li>  <li>Threat hunting activities are identified; and</li>  <li>Threat indicator information and effective mitigations obtained from, at a minimum, open or commercial sources and any DoD-provided sources, are used to guide and inform intrusion detection and threat hunting.</li>  </ol>    <div class="sub-header-1">POTENTIAL ASSESSMENT METHODS AND OBJECTS</div>  <div class="sub-header-2">Examine</div>  <p>[SELECT FROM: System and information integrity policy; information security program plan; procedures addressing security alerts, advisories, and directives; threat awareness program documentation; procedures addressing system monitoring; procedures for the threat awareness program; risk assessment results relevant to threat awareness; records of security alerts and advisories; system design documentation; security plan; system monitoring tools and techniques documentation; system configuration settings and associated documentation; system monitoring logs or records; system audit records; documentation on the cross-organization information-sharing capability; other relevant documents or records].</p>  <div class="sub-header-2">Interview</div>  <p>[SELECT FROM: Organizational personnel responsible for information security program planning and plan implementation; system/network administrators; organizational personnel responsible for the threat awareness program; organizational personnel responsible for the cross-organization information-sharing capability; organizational personnel responsible for information security; organizational personnel responsible for installing, configuring, and/or maintaining the system; organizational personnel security alerts and advisories; organizational personnel responsible for implementing, operating, maintaining, and using the system; organizational personnel, organizational elements, and/or external organizations to whom alerts, advisories, and directives are to be disseminated; personnel with whom threat awareness information is shared by the organization; system developers].</p>  <div class="sub-header-2">Test</div>  <p>[SELECT FROM: Mechanisms supporting and/or implementing the threat awareness program; mechanisms supporting and/or implementing the cross-organization information- sharing capability; mechanisms supporting and/or implementing the system monitoring capability; mechanisms supporting and/or implementing the definition, receipt, generation, and dissemination of security alerts, advisories, and directives; mechanisms supporting and/or implementing security directives; mechanisms supporting and/or implementing threat hunting; mechanisms supporting and/or implementing intrusion detection; mechanisms supporting and/or implementing the discovery, collection, distribution, and use of indicators of compromise].</p>    <div class="sub-header-1">DISCUSSION</div>  <p>Threat information related to specific threat events (e.g., TTPs, targets) that organizations have experienced, threat mitigations that organizations have found to be effective against certain types of threats, and threat intelligence (i.e., indications and warnings about threats that can occur) are sourced from and shared with trusted organizations. This threat information can be used by organizational Security Operations Centers (SOC) and incorporated into monitoring capabilities. Threat information sharing includes threat indicators, signatures, and adversary TTPs from organizations participating in threat- sharing consortia, government-commercial cooperatives, and government-government cooperatives (e.g., CERTCC, CISA/US-CERT, FIRST, ISAO, DIB CS Program). Unclassified indicators, based on classified information but which can be readily incorporated into organizational intrusion detection systems, are available to qualified nonfederal organizations from government sources.</p>    <div class="sub-header-1">FURTHER DISCUSSION</div>  <p>One way to effectively leverage threat indicator information is to access human- or machine- readable threat intelligence feeds. Effectiveness may also require the organization to create TTPs in support of operational requirements, which will typically include defensive cyber tools supporting incident detection, alerts, incident response, and threat hunting. It is possible that this requirement will be implemented by a third-party managed service provider, and in that case, it will be necessary to carefully define the boundary and responsibilities between the OSC and the ESP to guarantee a robust implementation. It is also important that the OSC validate threat indicator integration into the defensive cyber toolset by being able to (1) implement mitigations for sample industry relevant indicators of compromise (e.g., IP address, file hash), (2) identify sample indicators of compromise across sample endpoints, and (3) identify sample indicators of compromise using analytical processes on a system data repository.</p>  <div class="sub-header-2">Example</div>  <p>You are responsible for information security in your organization. You have maintained an effective intrusion detection capability for some time, but now you decide to introduce a threat hunting capability informed by internal and external threat intelligence [a,c,d,e]. You install a SIEM system that leverages threat information to provide functionality to:</p>  <ul>  <li>analyze logs, data sources, and alerts;</li>  <li>query data to identify anomalies;</li>  <li>identify variations from baseline threat levels;</li>  <li>provide machine learning capabilities associated with the correlation of anomalous data characteristics across the enterprise; and</li>  <li>categorize data sets based on expected data values.</li>  </ul>  <p>Your team also manages an internal mitigation plan (playbook) for all known threats for your environment. This playbook is used to implement effective mitigation strategies across the environment [b]. Some of the mitigation strategies are developed by team members, and others are obtained by threat feed services.</p>  <div class="sub-header-2">Potential Assessment Considerations</div>  <ul>  <li>Which external sources has the organization identified as threat information sources [a]?</li>  <li>Does the organization understand the TTPs of key attackers [c,d]?</li>  <li>Does the organization deploy threat indicators to EDR systems, network intrusion detection systems, or both [c,d,e]?</li>  <li>What actions does the organization implement when a threat alert/indicator is signaled [c,d,e]?</li>  <li>Does the organization use internal threat capabilities within their existing security tools [e]?</li>  <li>How does the organization respond to a third-party notification of a threat indicator [e]?</li>  </ul>    ' WHERE [Mat_Question_Id] = 5418
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Supplemental_Info]=N'<p class="MsoNoSpacing"><a></a><a><b>Item(s) for Review: </b></a></p><p class="MsoNoSpacing"><b>SCUEP IT-2: </b>Most recent annual or comprehensive report to the board or board committee on the overall status of the information security program.</p><p class="MsoNoSpacing">&#160;</p><p class="MsoNoSpacing"><b><span>SCUEP IT-3: </span></b><span>Reports for internal and external IT audits and controls testing (e.g., IT general controls reviews, penetration tests, vulnerability assessments, social engineering tests) conducted since the prior examination</span></p><p class="MsoNormal">&#160;</p><p class="MsoNormal">To comply with GLBA guidelines, management should report at least annually to the board or responsible committee of the board on the status and effectiveness of the information security program. This report should:</p><p class="MsoListParagraphCxSpFirst"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Describe the overall status of the information security program</p><p class="MsoListParagraphCxSpMiddle"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Address the credit union&#8217;s compliance with established guidelines</p><p class="MsoListParagraphCxSpMiddle"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Discuss material matters related to its program, addressing security concerns that include: </p><blockquote><p class="MsoListParagraphCxSpMiddle"><span>o<span>&#160;&#160; </span></span><b>risk assessment</b>&#8212;the results of the completed information security risk assessment should be reported to the board. </p><p class="MsoListParagraphCxSpMiddle"><span>o<span>&#160;&#160; </span></span><b>risk management and control decisions</b>&#8212;any changes to the credit union&#8217;s security controls, posture, or risk tolerance, and any acceptance of risk. </p><p class="MsoListParagraphCxSpMiddle"><span>o<span>&#160;&#160; </span></span><b>service provider arrangements</b>&#8212;information on the vendor management program, such as the breakdown of vendors by criticality, status of due diligence, any vendor concerns, or new vendors hired. </p><p class="MsoListParagraphCxSpMiddle"><span>o<span>&#160;&#160; </span></span><b>results of testing</b>&#8212;any issues identified in the external audits and assessments, including the status of remediation. </p><p class="MsoListParagraphCxSpMiddle"><span>o<span>&#160;&#160; </span></span><b>security breaches</b>&#8212;any breaches or violations and management&#8217;s responses to these incidents should be covered in the reported period; and </p><p class="MsoListParagraphCxSpLast"><span>o<span>&#160;&#160; </span></span><b>recommendations</b>&#8212;for changes to the information security program.</p></blockquote><p class="MsoNormal">&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;</p>&#10;&#10;&#10;' WHERE [Mat_Question_Id] = 7577
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Supplemental_Info]=N'<p class="MsoNormal"><a><b>Items(s) for Review: </b></a></p><p class="MsoNormal"><b>SCUEP IT-5:</b> <span class="MsoHyperlink">Documentation for information security training provided to staff, management, and officials since the prior examination, including tracking reports. Also provide support for any member education or guidance.</span></p><p class="MsoNormal">&#160;</p><p class="MsoNormal">A credit union should establish an organization-wide information security awareness training program to address threats and inform employees about information security controls and the employees&#8217; information security responsibilities. The training program should consider evolving and persistent cyber-threats, including: </p><p class="MsoListParagraphCxSpFirst"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>phishing, </p><p class="MsoListParagraphCxSpMiddle"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>social engineering, </p><p class="MsoListParagraphCxSpMiddle"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>DDoS, </p><p class="MsoListParagraphCxSpMiddle"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>account takeover, </p><p class="MsoListParagraphCxSpMiddle"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>ransomware, and</p><p class="MsoListParagraphCxSpLast"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>any emerging issues. </p><p class="MsoNormal">Training should include annual certification that personnel understand their responsibilities. In addition, new employees should receive training shortly after they are onboarded. </p><p class="MsoNormal">The information security awareness training program should support policy awareness and compliance and be updated frequently to address the various types of cyber-threats by describing the threats, attack vectors, and potential impact on the credit union&#39;s systems and members.</p><p class="MsoNormal"><b>Best practices CIS Safeguards 14.6</b> instructs institutions to also train employees in recognizing and reporting a potential incident.</p><p class="MsoNormal">A credit union should validate the effectiveness of their security awareness training program by employing techniques such as faux phishing campaigns or social engineering exercises. The results of these exercises can help a credit union identify areas of focus to provide additional training. Frequent testing of employees on various types of social engineering tactics helps to keep them prepared and vigilant for such attacks.</p><p class="MsoNormal">The key objective for any security awareness training program should be shaping employee behavior to reduce the likelihood and impacts of security incidents. Outcome-driven metrics tie training back to measurable protection benefits.&#160;Management should track and evaluate the results from the security awareness training program and maintain records of completed training&#10;for all employees.</p><p class="MsoNormal">&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;</p><p class="MsoNoSpacing">Members also benefit from information security awareness. For example, credit unions can use their website to educate them about current cyber threats and methods used to illegally access accounts and account information, such as phishing, social engineering, mobile-based trojans, and business email compromise.&#160;</p>&#10;&#10;&#10;' WHERE [Mat_Question_Id] = 7588
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Supplemental_Info]=N'<p class="MsoNoSpacing"><b>Item(s) for Review: </b></p><p class="MsoNoSpacing"><b>SCUEP IT-6: </b>Written incident response program for unauthorized access to member information and support for any material security incidents occurring since the prior examination, including associated notifications.</p><p class="MsoNoSpacing"><b>SCUEP IT-7: </b> Results of any testing of the incident response plan(s).</p><p class="MsoNoSpacing">&#160;</p><p class="MsoNormal">Per Interagency Guidance on Response Programs for Unauthorized Access to Customer Information and Customer&#10;Notice, each institution should have a risk-based response program to address unauthorized access to customer information. The incident response program should be appropriate to the size and complexity of the credit union and its information security risks. </p><p class="MsoNormal">At a minimum, a credit union&#39s response program should outline procedures to: </p><p class="MsoNormal"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Assess the nature and scope of an incident and&#10;identifying what member information systems and types of member information&#10;have been accessed or misused.</p><p class="MsoNormal"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Contain and control incidents to prevent further unauthorized access to or use of member information. These should list which personnel is responsible for taking these steps.</p><p class="MsoNormal"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Prepare, detect, contain, eradicate, remediate, and follow-up on incidents. Each phase of the incident handling should list steps or procedures to follow.</p><p class="MsoNormal"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Notify <span>law enforcement, insurers, regulators, other incident response vendors, and members. These procedures should include applicable regulatory timeframes, as well as who to notify (for example which law enforcement agencies), and when to file a Suspicious Activity Report (SAR).</span></p><p class="MsoNormal"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Address a third-party service provider incident, including defining the related notification responsibilities. The response program should designate an incident response team and include roles and responsibilities for team members. The program should include standards for timely notification to members and outline components of the member notice. </p><p class="MsoNormal">Member notice components should be provided in plain language and include:</p><p class="MsoListParagraphCxSpFirst"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Incident description</p><p class="MsoListParagraphCxSpMiddle"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Type of member information compromised</p><p class="MsoListParagraphCxSpMiddle"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>How the credit union will prevent further unauthorized access</p><p class="MsoListParagraphCxSpMiddle"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Informational phone number</p><p class="MsoListParagraphCxSpMiddle"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Reminder to members to remain vigilant over next 12-24 months</p><p class="MsoNormal">&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;</p><p class="MsoListParagraphCxSpLast"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Request to report ID theft to CU promptly</p>&#10;&#10;&#10;' WHERE [Mat_Question_Id] = 7594
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Supplemental_Info]=N'<p class="MsoNoSpacing"><a><b>Item(s) for Review: </b></a></p><p class="MsoNoSpacing"><b>SCUEP IT-8: </b>List of all third-party service providers with risk ratings and support for the latest due diligence of monitoring of the core data processor, e-banking provider, and any newly contracted IT vendors.</p><p class="MsoNoSpacing"><b>SCUEP IT-9: </b>Documentation demonstrating contracts with critical service providers address the timely notification of cyber incidents.</p><p class="MsoNoSpacing">&#160;</p><p class="MsoNormal">Credit unions have increasingly developed third party relationships to meet strategic objectives and enhance member services. Properly managed and controlled third party relationships provide a wide range of potential benefits to credit unions and their members. Many credit unions have utilized third party arrangements to gain expertise, realize economies of scale, or even reach new members. Leveraging the talents and experience of third parties can assist credit unions in meeting their members needs while accomplishing their strategic goals. In some cases, third party relationships are critical to the on-going success of a credit union. </p><p class="MsoNormal">By taking the time to properly evaluate and cultivate third party arrangements, credit unions can experience a high degree of success. Prudent credit unions will conduct thorough due diligence and evaluate any third-party contracts carefully. </p><p class="MsoNormal">Credit unions use due diligence to determine whether the risks undertaken in a third-party relationship are acceptable in relation to their risk profile and safety and soundness requirements. Less complex risk profiles and third-party arrangements typically require less analysis and documentation. Management may rely on third parties to provide critical services but remains responsible for ensuring the confidentiality, integrity and availability of the credit union&#39;s systems and information. Through oversight, a credit union monitors the effectiveness of the services provided by third parties.</p><p class="MsoNormal">Credit unions should only enter into service provider contracts that have appropriate information security measures. The contract should be clear about information security roles and responsibilities and outline the appropriate actions to address incidents of unauthorized access to or use of the credit union&#39;s member information. The contract should clearly require timely notification to the credit union of any incidents.</p><p class="MsoNormal">When evaluating third party arrangements, examiners verify the credit union has addressed the following concepts appropriately for its size, complexity, and risk profile:</p><ul type="disc"> <li class="MsoNormal">Risk Assessment and Planning.</li> <li class="MsoNormal">Due Diligence; and</li> <li class="MsoNormal">Risk Measurement, Monitoring and Control.</li></ul><p class="MsoNormal"><b>Vendor List</b></p><p class="MsoNormal">Management should maintain a current listing of all third-party service providers by risk rating/criticality (high, medium, low risk OR critical, non-critical, etc.) with a description of the services provided. The risk rating dictates the frequency (and the corresponding level of detail) of ongoing due diligence reviews by management. In rating risk, management should consider sensitivity of data accessed or controlled by the service provider. If a vendor has access to any sensitive information (member, employee, or credit union), stronger oversight is appropriate. Management should verify that third-party service providers implement and maintain sufficient controls to mitigate risks. </p><p class="MsoNormal">Although some credit unions outsource third party due diligence and monitoring, compliance with the credit union&#39;s vendor management program remains the responsibility of credit union management.</p><p class="MsoNormal"><b>Contracts</b></p><p class="MsoNormal">Contracts are the means for credit union management to require its service providers to implement appropriate measures designed to meet the objectives of regulatory guidelines for safeguarding member information (GLBA guidelines). </p><p class="MsoNormal">Contract considerations:</p><p class="MsoNormal"><span>&#8226;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Timeframe</p><p class="MsoNormal"><span>&#8226;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Details of the service or product to be provided</p><p class="MsoNormal"><span>&#8226;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Adequate and measurable service level agreements (SLAs)</p><p class="MsoNormal"><span>&#8226;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Compliance with all applicable laws, regulations, and regulatory guidance</p><p class="MsoNormal"><span>&#8226;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Third party insurance coverage</p><p class="MsoNormal"><span>&#8226;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Subcontractor clauses (permissibility, impermissibility)</p><p class="MsoNormal"><span>&#8226;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Right to audit</p><p class="MsoNormal"><span>&#8226;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Independent validation of security controls</p><p class="MsoNormal"><span>&#8226;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Confidentiality and security of information,&#10;including provision for prompt return or destruction of the credit union&s data</p><p class="MsoNormal">&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;</p><p class="MsoNormal"><span>&#8226;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Notification of any information security or business continuity incident in a timely manner.</p>&#10;&#10;&#10;', [Scope]=N'', [Recommend_Action]=N'', [Risk_Addressed]=N'', [Services]=N'' WHERE [Mat_Question_Id] = 7602
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Supplemental_Info]=N'<p class="MsoNoSpacing"><a><b>Item(s) for Review: </b></a></p><p class="MsoNoSpacing"><b>SCUEP IT-10: </b>Data&#10;Backup and Recovery plans and procedures, Business continuity plan (BCP),&#10;disaster recovery plan (DRP), business impact analysis, and BCP/DRP testing&#10;results since the prior examination.</p><p class="MsoNoSpacing">&#160;</p><p class="MsoNormal"><a>Disruptions resulting from cyber&#160;events,&#10;natural&#160;disasters, or man-made events can interrupt a credit union&#8217;s&#10;operations and can have a broad impact on the financial sector. <span>Business&#10;continuity management (BCM) is the process of planning for continuity of&#10;operations in the case of disaster. BCM addresses </span>resilience<span>,</span></a><span class="MsoFootnoteReference"><span><span class="MsoFootnoteReference"><span>[1]</span></span></span></span><span> continuity, and&#10;a credit union&#8217;s response capability to </span>safeguard employees, customers,&#10;and products and services. </p><p class="MsoNormal">A credit union&#8217;s BCM program should align&#10;with its strategic goals and objectives. <span>A BCM program has multiple components, including:</span><span></span></p><p class="MsoListParagraphCxSpFirst"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span><span>Business Impact Analysis (BIA)</span><span></span></p><p class="MsoListParagraphCxSpMiddle"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span><span>Business Continuity Plan (BCP)</span><span></span></p><p class="MsoListParagraphCxSpMiddle"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span><span>Backup and Recovery Plan</span><span></span></p><p class="MsoListParagraphCxSpLast"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span><span>Testing</span><span></span></p><p class="MsoNoSpacing"><b>Business Impact Analysis (BIA): </b></p><p class="MsoNormal"><span>Management&#10;should d</span>evelop a BIA that identifies all business functions and&#10;prioritizes them in order of criticality, analyzes&#10;related&#160;interdependencies&#160;among business processes and systems, and&#10;assesses a&#160;disruption&#8217;s impact through established metrics. The BIA should&#10;estimate a recovery time objective (RTO) and recovery point objective and&#10;define recovery priorities and resource dependencies for critical business&#10;processes. Ideally, RTOs are derived from a business impact analysis or similar&#10;effort to estimate the cost of downtime over various timeframes (short, medium,&#10;and longer term). If critical activities cannot be recovered within the defined&#10;RTO, the credit union should establish alternative processes <span>to resume critical activities.</span></p><p class="MsoNoSpacing"><b>Business Continuity Plan (BCP): </b></p><p class="MsoNormal">The&#10;credit union should have a board-approved business continuity, disaster&#10;recovery, and data backup program to recover operations following an incident.&#10;The BCP should address:</p><p class="MsoListParagraphCxSpFirst"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>BIA and risk assessment.</p><p class="MsoListParagraphCxSpMiddle"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Alternate processing for critical business&#10;functions while systems/applications and facilities are unavailable.</p><p class="MsoListParagraphCxSpMiddle"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Recovery strategies and procedures for critical&#10;systems/applications. </p><p class="MsoListParagraphCxSpMiddle"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Roles and responsibilities; and</p><p class="MsoListParagraphCxSpLast"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>BCP and disaster recovery testing.</p><p class="MsoNormal"><b>A backup and recovery plan</b> describes&#10;how critical systems are backed up and restored. Critical systems&#39; data is typically backed up at least daily, and recovery from backups should be tested&#10;periodically to verify the backup process is functioning properly.</p><p class="MsoNormal">The BCP focuses on critical business&#10;functions and varies according to the credit union&#8217;s size and complexity. The&#10;BCP includes specific elements, such as incident response, disaster recovery,&#10;and crisis management. Smaller credit unions may have a single BCP that&#10;includes these elements. Large, complex credit unions may have multiple plans&#10;specific to business functions, locations, or departments. </p><p class="MsoNormal">A comprehensive plan based on FFIEC&#8217;s BCP&#10;booklet would include:</p><ul type="disc">&#10; <li class="MsoNormal">Roles, responsibilities, and&#10;     required skills for credit union personnel and third-party service&#10;     providers</li>&#10; <li class="MsoNormal">Solutions to various types of&#10;     foreseeable disruptions (for example, fires, floods, etc.) including&#10;     disruptions caused by cyber threat actors</li>&#10; <li class="MsoNormal">Escalation thresholds</li>&#10; <li class="MsoNormal">Immediate steps to protect&#10;     personnel and customers and minimize damage</li>&#10; <li class="MsoNormal">Prioritization and procedures to&#10;     recover functions, services, and processes</li>&#10; <li class="MsoNormal">Critical information protection&#10;     (for example, physical, electronic, hybrid, and use of off-site storage)</li>&#10; <li class="MsoNormal">Alternate site plans including&#10;     logistical arrangements (for example, housing, transportation, or food)&#10;     for personnel at the recovery locations</li>&#10; <li class="MsoNormal">Network equipment, connectivity,&#10;     and communication needs, including credit union-owned and personal mobile&#10;     devices</li>&#10; <li class="MsoNormal">Personnel at alternate sites, including&#10;     arrangements for those permanently located at the alternate facility</li>&#10; <li class="MsoNormal">Scope and frequency of testing</li>&#10; <li class="MsoNormal">Pandemic plans</li>&#10; <li class="MsoNormal">Resumption of a normalized state&#10;     for business processes</li>&#10;</ul><p class="MsoNormal"><b><u><span>&#160;</span></u></b></p><p class="MsoNormal">The BCP should be a living document,&#10;regularly updated so that it remains current with system enhancements and&#10;organizational changes. </p><p class="MsoNoSpacing"><b>Testing: </b></p><p class="MsoNoSpacing">The BCP plan should require testing at a set&#10;frequency to validate the effectiveness of the credit union&#8217;s BCP and identify&#10;deficiencies. Exercises and tests&#160;help validate a credit union&#8217;s ability&#10;to restore critical business functions quickly. They also confirm that critical&#10;business functions are resilient and can maintain continuity. There are many&#10;types of exercises, depending on the intended goals and objectives. Exercises&#10;may include&#160;scenario-driven simulations of BCP elements. For example,&#10;exercises may include performing duties in a simulated environment (in other&#10;words, functional testing) or be discussion based (in other words, tabletop&#10;exercises). Testing should encompass internal and external dependencies,&#10;including activities outsourced to third-party service providers. A credit&#10;union does not need to test all systems simultaneously but should follow a&#10;comprehensive rotation of testing to cover all essential systems.<b></b></p><p class="MsoNormal"><span>Third-party service providers deliver critical services to&#10;many credit unions and should be included in the enterprise-wide exercise and&#10;testing program. A third party&#8217;s inclusion in the credit union&#8217;s BCP should be&#10;commensurate with the criticality of the third-party service provider and its&#10;involvement in the business function.</span><span></span></p><p class="MsoNormal">&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;</p><div><br clear="all">&#10;&#10;<hr align="left" size="1" width="33%">&#10;&#10;&#10;&#10;<div>&#10;&#10;<p class="MsoNormal"><span class="MsoFootnoteReference"><span class="MsoFootnoteReference"><span>[1]</span></span></span>Resilience includes proactive measures to mitigate disruptive events and evaluate a credit union&#39;s recovery capabilities.</p>&#10;&#10;</div>&#10;&#10;</div>&#10;&#10;&#10;' WHERE [Mat_Question_Id] = 7607
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Supplemental_Info]=N'<p class="MsoNoSpacing"><b>Item(s) for Review: </b></p><p class="MsoNoSpacing"><b>SCUEP IT-11: </b>Documentation to support&#10;antivirus/malware protection is running on endpoints, workstations, and&#10;servers.</p><p class="MsoNoSpacing"><b>&#160;</b></p><p class="MsoNoSpacing"><b>SCUEP IT-12: </b>Documentation supporting the use of&#10;e-mail web content filtering/SPAM controls.</p><p class="MsoNoSpacing"><b>&#160;</b></p><p class="MsoNoSpacing"><b>SCUEP IT-13: </b>Patch management procedures and three&#10;consecutive patch management reports for operating systems (e.g., Windows,&#10;Linux, etc.) and software applications (Adobe, MS Office, etc.)</p><p class="MsoNoSpacing">&#160;</p><p class="MsoNoSpacing"><b>SCUEP IT-14: </b>Procedures and checklists for&#10;onboarding, changing, and offboarding employee access to systems and&#10;applications. Support for user access reviews, including monitoring on inactive&#10;accounts, conducted since the prior examination.</p><p class="MsoNormal">&#160;</p><p class="MsoNoSpacing"><b>SCUEP IT-15: </b>Documentation of network defense and&#10;perimeter controls such as firewalls, and intrusion detection/prevention&#10;systems.</p><p class="MsoNoSpacing"><b>&#160;</b></p><p class="MsoNoSpacing"><b>Anti-Virus/Anti-Malware:</b></p><p class="MsoNormal">Because anti-virus alerts are computer incidents and&#10;potential indicators of a network compromise, management needs to ensure they&#10;are investigated and resolved. <a>Management should&#10;require the IT function to:</a></p><p class="MsoListParagraphCxSpFirst"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Install anti-virus/anti-malware on all desktops,&#10;laptops, and servers.</p><p class="MsoListParagraphCxSpMiddle"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Deploy signature updates automatically. </p><p class="MsoListParagraphCxSpMiddle"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Send notifications when a virus is detected; and&#10;</p><p class="MsoListParagraphCxSpLast"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Make reports or dashboards available for review.&#10;</p><p class="MsoNormal">In instances where anti-virus protection cannot be deployed,&#10;management should identify and implement mitigating measures based upon the&#10;credit union&#39;s risk assessment. Anti-malware reports can be compared to asset&#10;inventory reports to verify all devices are included.</p><p class="MsoNoSpacing"><b>Email filtering:</b></p><p class="MsoNormal">Email is inherently insecure. A credit union&#39;s email can be subject to interception, alteration, and counterfeiting by anyone on the&#10;virtual path between the sender and the recipient.</p><p class="MsoNormal">The National Institute of Standards and Technology (NIST)&#10;defines spam as electronic junk mail or the abuse of electronic messaging&#10;systems to indiscriminately send unsolicited bulk messages. Blocking spam&#10;messages is the first line of defense to protect e-mail users from malicious&#10;file attachments and links.</p><p class="MsoNormal">Credit unions protect themselves from malicious code by&#10;deploying anti-virus, anti-spyware, and anti-spam filtering, and by blocking&#10;the ability to download executable files. </p><p class="MsoNoSpacing"><b>Email Encryption:</b></p><p class="MsoNormal">When sending sensitive documents or emails, a credit union&#10;should consider encrypting those documents and/or emails. Many document and&#10;email applications provide this capability. Typically, the receiver will need&#10;to have the same application to de-crypt the message or document as used to&#10;encrypt it. If you need to send a recipient a password or key, give it to them&#10;via phone or other method. Never send a password or key in the same email as&#10;the encrypted document.<b></b></p><p class="MsoNoSpacing"><b>Patch Management:</b></p><p class="MsoNormal"><a>Patch Management is an easy concept&#10;to understand, but a challenge to execute. Patch management is the process of&#10;identifying, acquiring, installing, and verifying patches for products and systems.&#10;Patches correct security and functionality problems in software and firmware.&#10;Patch management is required by various security compliance frameworks,&#10;mandates, and other policies. For example, NIST Special Publication (SP)&#10;800-532 establishes the SI-2, Flaw Remediation security control, which&#10;includes: </a></p><p class="MsoListParagraphCxSpFirst"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Installing security-relevant software and&#10;firmware patches, </p><p class="MsoListParagraphCxSpMiddle"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Testing patches before installing them, and </p><p class="MsoListParagraphCxSpLast"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Incorporating patches into the organization&#8217;s&#10;configuration management processes. </p><p class="MsoNormal">Another example is&#10;the Payment Card Industry Data Security Standard, which requires installing the&#10;latest patches and sets a maximum timeframe for installing the most critical&#10;patches.</p><p class="MsoNormal">Vendors routinely&#10;issue patches or security updates to address vulnerabilities found on&#10;institutions systems. <b>Best Practice CIS Safeguard 7.4</b> recommends monthly&#10;updates at a minimum. The latest patches should be deployed to critical systems&#10;as soon as possible. If critical patches are not applied promptly, a hacker&#10;could exploit these vulnerabilities to access sensitive data. An effective&#10;patch management plan will include:</p><p class="MsoListParagraphCxSpFirst"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>A patching schedule, </p><p class="MsoListParagraphCxSpMiddle"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Expected timeframes for applying patches based&#10;on</p><p class="MsoListParagraphCxSpMiddle"><span>o<span>&#160;&#160; </span></span>criticality</p><p class="MsoListParagraphCxSpMiddle"><span>o<span>&#160;&#160; </span></span>risk</p><p class="MsoListParagraphCxSpMiddle"><span>o<span>&#160;&#160; </span></span>testing&#10;environment</p><p class="MsoListParagraphCxSpLast"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>A reporting function that covers which patches&#10;have and have not been applied. </p><p class="MsoNormal">When feasible,&#10;credit unions should test software and firmware updates before full deployment&#10;into production systems.&#160; This enables&#10;them to identify potential compatibility and instability issues that could&#10;cause serious operational disruptions.</p><p class="MsoNormal">Keeping up with&#10;patches is challenging to manage even for less complex credit unions.&#10;Management should implement automated patch management systems and software to&#10;protect all network components, including servers, virtual machines, routers,&#10;switches, mobile devices, and firewalls, with appropriate updates.<span> </span>Some systems may be manually patched. </p><p class="MsoNormal">Patch management&#10;solutions can produce a variety of reports, including patch compliance,&#10;exceptions, and days outstanding. Missing critical patches to servers,&#10;desktops, laptops, and other devices should be remediated as soon as possible&#10;unless there is an approved exception. If patch management is outsourced to a&#10;vendor, then the vendor should provide patch status reports to the credit union&#8217;s&#10;management. </p><p class="MsoNormal">Vulnerability scans&#10;help detect vulnerabilities for which there are patches available that may have&#10;been missed by the credit union&#8217;s patch management program and processes.</p><p class="MsoNoSpacing"><b>Passwords:</b></p><p class="MsoNormal">Strong passwords help mitigate credential guessing and&#10;cracking. Password complexity is determined by length and the combination of&#10;unpredictable characters. According to <b>Best Practice CIS Safeguard5.2</b>&#10;(Use Unique Passwords), implementation should include a minimum password of 8&#10;characters for accounts using MFA and 14 characters for accounts not using MFA.&#10;Delete or disable any inactive accounts after a period of 45 days of&#10;inactivity, where supported. </p><p class="MsoNormal">Access controls also include limiting the number of password&#10;attempts&#8212;typically&#10;three&#8212;before&#10;a user is locked out. Controls also prohibit the reuse of passwords. This means&#10;users are not allowed to enter a new password based on alteration of one&#10;character. Instead the system requires an entirely new character string.</p><p class="MsoNormal">The NIST 7621, Small Business Information Security, The&#10;Fundamentals, provides the following information regarding the use of strong&#10;passwords:</p><p class="MsoQuote">For systems or applications that&#10;have important information, use multiple forms of identification (called&#10;&#8220;multi-factor&#8221; or &#8220;dual factor&#8221; authentication). For example, when a user logs&#10;in with a password, they may be sent a text message with a code they have to&#10;enter as well. Biometrics (e.g. fingerprint scanners) and other devices may be&#10;used but can be expensive and difficult to install or maintain.</p><p class="MsoQuote">Many devices come with default&#10;administration passwords &#8211; these should be changed immediately when installing&#10;and regularly thereafter. Default passwords are easily found or known by&#10;hackers and can be used to access the device. The manual or those who install the&#10;system should be able to show you how to change them.</p><p class="MsoQuote">Passwords to devices and&#10;applications that deal with business information should not be re-used. If a&#10;hacker gains access to one account, they will have access to all others that&#10;share that password. It may be difficult to remember a number of different&#10;passwords so a password management system may be an option. However, these&#10;systems place all passwords into one place which may be lost or compromised.&#10;Carefully compare password management solutions before purchasing.</p><p class="MsoNormal">Passwords are often the only barrier protecting your&#10;personal information. There are several techniques attackers can use to help&#10;guess or &#34;crack&#34; passwords. However, choosing strong passwords and&#10;keeping them confidential can make it more difficult for others to access&#10;information.</p><p class="MsoNormal">Passwords that do not change for long periods of time allow&#10;hackers time to crack them and may be shared and become common knowledge to an&#10;individual user&#8217;s coworkers. Therefore, passwords should be changed at least&#10;every three months. If possible, consider configuring systems and devices to&#10;require users to change their passwords every three months.</p><p class="MsoNormal">NCCIC/US-CERT recommends users take the following actions:</p><p class="MsoListParagraphCxSpFirst"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Use multi-factor authentication when available</p><p class="MsoListParagraphCxSpMiddle"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Use different passwords on different systems and&#10;accounts</p><p class="MsoListParagraphCxSpMiddle"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Don&#39;t use passwords that are based on personal&#10;information that can be easily accessed or guessed</p><p class="MsoListParagraphCxSpMiddle"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Use the longest password or passphrase&#10;permissible by each password system</p><p class="MsoNormal">&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;</p><p class="MsoListParagraphCxSpLast"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Don&#39;t use words that can be found in any&#10;dictionary of any language</p>&#10;&#10;&#10;' WHERE [Mat_Question_Id] = 7612
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Supplemental_Info]=N'<p class="MsoNoSpacing"><span class="MsoHyperlink"><b><span>Item(s) for Review: </span></b></span></p><p class="MsoNoSpacing"><span class="MsoHyperlink"><b><span>IT CORE 2:</span></b></span><span class="MsoHyperlink"><span>&#10;Most recent annual or comprehensive report to the board or board committee on&#10;the overall status of the information security program.</span></span></p><p class="MsoNoSpacing"><b>IT CORE 3: </b>Reports for internal and external IT audits and controls testing (e.g., IT general controls reviews, penetration tests, vulnerability assessments, social engineering tests) conducted since the prior examination.</p><p class="MsoNoSpacing">&#160;</p><p class="MsoNormal">To comply with&#10;GLBA guidelines, management should report at least annually to the board or&#10;responsible committee of the board on the status and effectiveness of the&#10;information security program. This report should:</p><p class="MsoListParagraphCxSpFirst"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Describe the overall status of the information&#10;security program</p><p class="MsoListParagraphCxSpMiddle"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Address the credit union&#39;s compliance with&#10;established guidelines</p><p class="MsoListParagraphCxSpMiddle"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Discuss material matters related to its program,&#10;addressing security concerns that include: </p><p class="MsoListParagraphCxSpMiddle"><span>o<span>&#160;&#160;&#10;</span></span><b>risk assessment</b>&#8212;the results of the&#10;completed information security risk assessment should be reported to the board.&#10;</p><p class="MsoListParagraphCxSpMiddle"><span>o<span>&#160;&#160;&#10;</span></span><b>risk management and control decisions</b>&#8212;any&#10;changes to the credit union&#8217;s security controls, posture, or risk tolerance,&#10;and any acceptance of risk. </p><p class="MsoListParagraphCxSpMiddle"><span>o<span>&#160;&#160;&#10;</span></span><b>service provider arrangements</b>&#8212;information&#10;on the vendor management program, such as the breakdown of vendors by&#10;criticality, status of due diligence, any vendor concerns, or new vendors&#10;hired. </p><p class="MsoListParagraphCxSpMiddle"><span>o<span>&#160;&#160;&#10;</span></span><b>results of testing</b>&#8212;any issues identified&#10;in the external audits and assessments, including the status of remediation. </p><p class="MsoListParagraphCxSpMiddle"><span>o<span>&#160;&#160;&#10;</span></span><b>security breaches</b>&#8212;any breaches or&#10;violations and management&#8217;s responses to these incidents should be covered in&#10;the reported period; and </p><p class="MsoNormal">&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;</p><p class="MsoListParagraphCxSpLast"><span>o<span>&#160;&#160;&#10;</span></span><b>recommendations&#8212;</b>for changes to the&#10;information security program.</p>&#10;&#10;&#10;' WHERE [Mat_Question_Id] = 7628
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Supplemental_Info]=N'<p class="MsoNoSpacing"><span class="MsoHyperlink"><b><span>Item(s) for Review: </span></b></span></p><p class="MsoNoSpacing"><span class="MsoHyperlink"><b><span>IT CORE 4:</span></b></span><span class="MsoHyperlink"><span> IT&#10;asset inventories, to include a hardware inventory report showing each server&#10;and workstation and its operating system, and a software inventory report&#10;showing the number of installed instances of each software program.</span></span></p><p class="MsoNoSpacing"><b><span>&#160;</span></b></p><p class="MsoNormal">An asset inventory process includes a comprehensive report&#10;or listing of a credit union&#8217;s hardware (for example, physical, and virtual&#10;servers, operating systems, and business applications), portable and mobile&#10;devices, and other network equipment. Reporting should also include the credit&#10;union&#8217;s software assets, identifying the device type and software version to&#10;help the credit union manage software updates and patches. Management should&#10;keep this inventory current and accurate and have an independent source&#10;periodically validate its accuracy.</p><p class="MsoNormal">Institutions cannot protect and monitor assets that they&#10;don&#8217;t know they have. Unmanaged or unauthorized devices can become targets for&#10;attack against the institution. Accurate inventories assist management with&#10;cyber risk and recovering from and responding to incidents. Maintaining an&#10;asset inventory is an ongoing process. Smaller or less complex entities may use&#10;informal methods (for example, spreadsheets) to track IT assets. Larger or more&#10;complex entities may use automated tools to assist with IT asset management.&#10;Automated tools serve a variety of functions, such as logging and vital asset&#10;statistics. Some automated tools alert management when a new or unapproved&#10;device is connected to the credit union&#8217;s network. </p><p class="MsoNormal">Management should keep the inventory list updated and remove&#10;unauthorized assets. Anything connected to the network with an IP address&#10;should be included in the inventory, including virtual hardware. </p><p class="MsoNormal">At a minimum, the Hardware asset inventory should include&#10;the following data:</p><p class="MsoNormal"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Network (IP) Address </p><p class="MsoNormal"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Machine Name</p><p class="MsoNormal"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Vendor and model</p><p class="MsoNormal"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Operating System</p><p class="MsoNormal">Additional information in this area is provided in the FFIEC&#10;IT Booklet &#8220;<i>Architecture, Infrastructure, and Operations.</i>&#8221;</p><p class="MsoNormal">The Software Inventory typically includes:</p><p class="MsoNormal"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Application/software name</p><p class="MsoNormal"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Version</p><p class="MsoNormal"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Manufacturer</p><p class="MsoNormal"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Number of installations</p><p class="MsoNormal"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Software Type </p><p class="MsoNormal">Without a complete and accurate software inventory,&#10;institutions cannot identify any vulnerable software, or software that may&#10;create a potential security risk. Additionally, management should establish an&#10;approved or authorized software list. Unauthorized software programs can be&#10;limited to specific versions or from a specific source. Unauthorized software&#10;should be investigated and removed. </p><p class="MsoNoSpacing">&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;</p><p class="MsoNormal">Management should establish clear accountability for the&#10;oversight of the asset inventory. <b>Best practice</b> <b>CIS Safeguard 2.1</b>&#10;recommends reviewing and updating the software inventory bi-annually, or more&#10;frequently. For any unsupported software, management should document approved&#10;exceptions. Documentation should include any mitigating controls and the risk&#10;acceptance process.</p>&#10;&#10;&#10;' WHERE [Mat_Question_Id] = 7633
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Supplemental_Info]=N'<p class="MsoNoSpacing"><span class="MsoHyperlink"><b><span>Item(s) for Review: </span></b></span></p><p class="MsoNoSpacing"><span class="MsoHyperlink"><b><span>IT CORE 5:</span></b></span><span class="MsoHyperlink"><span>&#10;Information security risk assessment, and any supplemental supporting&#10;documentation.&#160; Also provide&#10;cybersecurity, access controls and authentication, and e-banking risk&#10;assessments and self-assessments, if separate.</span></span></p><p class="MsoNormal">&#160;</p><p class="MsoNormal">Risk is a function of threats, vulnerabilities, the&#10;likelihood of an event, and the potential impact such an event would have to&#10;the business. By understanding the risks, a credit union can know where to&#10;focus their efforts. A credit union can never eliminate risk.&#160; The goal of the information security program&#10;should be to provide reasonable assurance that you have made informed decisions&#10;related to the security of your information. </p><p class="MsoNormal">&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;</p><p class="MsoNormal">Risk is&#10;determined through an analysis of the Threats, Vulnerabilities, Likelihood, and&#10;Impact.&#160;</p>&#10;&#10;<div><br>&#10;<img src="data:image/png;base64,' WHERE [Mat_Question_Id] = 7639
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Supplemental_Info]=N'<p class="MsoNoSpacing"><span class="MsoHyperlink"><b><span>Item(s) for Review: </span></b></span></p><p class="MsoNoSpacing"><span class="MsoHyperlink"><b><span>IT CORE 6:</span></b></span><span class="MsoHyperlink"><span>&#10;Reports for internal and external IT audits and controls testing (e.g., IT&#10;general controls reviews, penetration tests, vulnerability assessments, social&#10;engineering tests) conducted since the prior examination.</span></span></p><p class="MsoNoSpacing">&#160;</p><p class="MsoNormal">A well-planned, properly&#10;structured audit program is essential to evaluate risk management practices,&#10;internal control systems, and compliance with corporate policies concerning&#10;IT-related risks at institutions of every size and complexity. Effective audit&#10;programs are risk-focused and promote sound IT controls across the credit&#10;union. To determine what risks exist, management should prepare an independent&#10;assessment of the credit union&#39;s risk exposure and the quality of the internal&#10;controls associated with the development, acquisition, implementation, and use&#10;of information technology (i.e., new products, services, and delivery&#10;channels).</p><p class="MsoNormal">An effective audit program&#10;evaluates risk management practices, internal control systems, and compliance&#10;with corporate policies concerning IT-related risks. Cybersecurity controls are&#10;an integral part of the credit union&#39;s information security control environment&#10;and like all control systems, independent audit is responsible for validating&#10;that they are effective and commensurate with the credit union&#39;s risk profile.</p><p class="MsoNormal">Institutions should have an audit&#10;schedule that includes frequency of an independent, periodic (typically an&#10;annual) IT General Controls audit, internal and external vulnerability scanning,&#10;internal and external penetration testing, and social engineering testing based&#10;on risk.</p><p class="MsoNormal"><b>IT Audit:</b> The majority of&#10;institutions outsource IT audits to third parties. A general IT controls audit&#10;typically covers IT governance, policies and procedures, vendor management,&#10;access controls, change management, BCP, and other areas depending on the scope&#10;of the audit.</p><p class="MsoNormal"><b>Vulnerability Scans:</b> All&#10;institutions should have periodic independent external and internal&#10;vulnerability scans/assessments. Scans discover vulnerabilities on the internal&#10;network and externally facing assets. Organizations employ network scanning&#10;tools to identify and prevent the use of prohibited functions, protocols,&#10;ports, and services. If not remediated, weaknesses on the network can be exploited&#10;by a bad actor to compromise computer systems.. The scanning can be done with&#10;an appliance placed on the network that automatically scans assets at&#10;predetermined intervals or can be completely outsourced to third parties. If&#10;the scanning is done internally by IT staff not independent of the process,&#10;then management should engage an independent third party to validate and&#10;confirm internal results at least annually. </p><p class="MsoNormal"><b>Penetration Testing:</b> A&#10;penetration test attempts to exploit discovered vulnerabilities by using&#10;various custom tools or scripts and includes more analysis. Penetration testing&#10;is performed by a qualified independent third party. <b>Best practice CIS&#10;Safeguards 18.5</b> recommends at least an annual testing.</p><p class="MsoNormal">&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;</p><p class="MsoNormal"><b>Social Engineering Testing:</b>&#10;This includes phishing testing, vishing calls or text, or physical social&#10;engineering. Phishing testing is often done internally using a vendor platform&#10;and validated periodically by an independent third party. Vishing and physical&#10;social engineering tests are typically done every other year or more frequently&#10;based on risk.</p>&#10;&#10;&#10;' WHERE [Mat_Question_Id] = 7645
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Supplemental_Info]=N'<p class="MsoNoSpacing"><span class="MsoHyperlink"><b><span>Item(s) for Review: </span></b></span></p><p class="MsoNoSpacing"><span class="MsoHyperlink"><b><span>IT CORE 7:</span></b></span><span class="MsoHyperlink"><span>&#10;Reporting and tracking documentation on the corrective action on, and status&#10;of, weaknesses cited in IT examinations, audits, tests, service provider/vendor&#10;reviews, and internal reviews.</span></span></p><p class="MsoNoSpacing">&#160;</p><p class="MsoNormal">Proper remediation of material&#10;weaknesses is a basic and essential component of effective audit oversight.&#10;Credit union management should establish a formal tracking process to monitor&#10;remediation progress and a reporting process that documents responsibility. The&#10;results of the reporting process should be shared with management frequently.</p><p class="MsoNormal">Typically, a tracking report&#10;includes the following: </p><p class="MsoListParagraphCxSpFirst"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Issue or finding,</p><p class="MsoListParagraphCxSpMiddle"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Date Discovered,</p><p class="MsoListParagraphCxSpMiddle"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Target Resolution Date,</p><p class="MsoListParagraphCxSpMiddle"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Party Responsible,</p><p class="MsoListParagraphCxSpMiddle"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Periodic Status updates, and</p><p class="MsoListParagraphCxSpLast"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Date Resolved.</p><p class="MsoNormal">Internal Audit or the Supervisory&#10;Committee should:</p><p class="MsoListParagraphCxSpFirst"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Identify weaknesses, </p><p class="MsoListParagraphCxSpMiddle"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Review management&#39;s plans for addressing those&#10;weaknesses, </p><p class="MsoListParagraphCxSpMiddle"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Monitor resolution, and </p><p class="MsoListParagraphCxSpLast"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Report to the board as necessary on material&#10;weaknesses. </p><p class="MsoNormal">&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;</p><p class="MsoNormal">The board, supervisory committee,&#10;and/or audit committee meeting minutes should reflect monitoring and status&#10;updates for all audit findings. The timing of the resolution should be&#10;commensurate with the criticality of the finding.&#160;</p>&#10;&#10;&#10;' WHERE [Mat_Question_Id] = 7652
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Supplemental_Info]=N'<p class="MsoNoSpacing"><span class="MsoHyperlink"><b><span>Item(s) for Review: </span></b></span></p><p class="MsoNoSpacing"><span class="MsoHyperlink"><b><span>IT CORE 8: </span></b></span><span class="MsoHyperlink"><span>Documentation for information security training provided to staff, management, and officials since the prior examination, including tracking reports. Also provide support for any member education or guidance.</span></span></p><p class="MsoNoSpacing">&#160;</p><p class="MsoNormal">A credit union should establish&#10;an organization-wide information security awareness training program to address&#10;threats and inform employees about information security controls and the&#10;employees&#8217; information security responsibilities. The training program should&#10;consider evolving and persistent cyber-threats, including: </p><p class="MsoListParagraphCxSpFirst"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>phishing, </p><p class="MsoListParagraphCxSpMiddle"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>social engineering, </p><p class="MsoListParagraphCxSpMiddle"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>DDoS, </p><p class="MsoListParagraphCxSpMiddle"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>account takeover, </p><p class="MsoListParagraphCxSpMiddle"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>ransomware, and</p><p class="MsoListParagraphCxSpLast"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>any emerging issues. </p><p class="MsoNormal">Training should include annual&#10;certification that personnel understand their responsibilities. In addition,&#10;new employees should receive training shortly after they are onboarded. </p><p class="MsoNormal">The information security&#10;awareness training program should support policy awareness and compliance and&#10;be updated frequently to address the various types of cyber-threats by&#10;describing the threats, attack vectors, and potential impact on the credit&#10;union&#39;s systems and members.</p><p class="MsoNormal"><b>Best practices CIS Safeguards&#10;14.6</b> instructs institutions to also train employees in recognizing and&#10;reporting a potential incident.</p><p class="MsoNormal">A credit union should validate the&#10;effectiveness of their security awareness training program by employing&#10;techniques such as faux phishing campaigns or social engineering exercises. The&#10;results of these exercises can help a credit union identify areas of focus to&#10;provide additional training. Frequent testing of employees on various types of&#10;social engineering tactics helps to keep them prepared and vigilant for such&#10;attacks.</p><p class="MsoNormal">The key objective for any&#10;security awareness training program should be shaping employee behavior to&#10;reduce the likelihood and impacts of security incidents. Outcome-driven metrics&#10;ties training back to measurable protection benefits.&#160;Management should&#10;track and evaluate the results from the security awareness training program and&#10;maintain records of completed training for all employees.</p><p class="MsoNormal">&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;<span>Members also benefit from information security&#10;awareness. For example, credit unions can use their website to educate customers&#10;about current cyber threats and methods used to illegally access accounts and&#10;account information, such as phishing, social engineering, mobile-based&#10;trojans, and business email compromise.&#160;</span><br></p>&#10;&#10;&#10;' WHERE [Mat_Question_Id] = 7655
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Supplemental_Info]=N'<p class="MsoNoSpacing"><span class="MsoHyperlink"><b><span>Item(s) for Review: </span></b></span></p><p class="MsoNoSpacing"><span class="MsoHyperlink"><b><span>IT CORE 9: </span></b></span><span class="MsoHyperlink"><span>Written incident response program for unauthorized access to member information&#10;and support for any material security incidents occurring since the prior&#10;examination, including associated notifications.</span></span></p><p class="MsoNoSpacing"><b>IT CORE 10: </b>Results of any testing of the incident response plan(s).</p><p class="MsoNoSpacing"><span class="MsoHyperlink"><span>&#160;</span></span></p><p class="MsoNormal">Per Interagency Guidance on&#10;Response Programs for Unauthorized Access to Customer Information and Customer&#10;Notice, each institution should have a risk-based response program to address&#10;unauthorized access to customer information. The incident response program&#10;should be appropriate to the size and complexity of the credit union and its&#10;information security risks. </p><p class="MsoNormal">At a minimum, a credit union&#39;s response program should outline procedures to: </p><p class="MsoNormal"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Assess the nature and scope of an incident and&#10;identifying what member information systems and types of member information&#10;have been accessed or misused.</p><p class="MsoNormal"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Contain and control incidents to prevent further&#10;unauthorized access to or use of member information. These should list which&#10;personnel is responsible for taking these steps.</p><p class="MsoNormal"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Prepare, detect, contain, eradicate, remediate,&#10;and follow-up on incidents. Each phase of the incident handling should list&#10;steps or procedures to follow.</p><p class="MsoNormal"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Notify <span>law&#10;enforcement, insurers, regulators, other incident response vendors, and members.&#10;These procedures should include applicable regulatory timeframes, as well as&#10;who to notify (for example which law enforcement agencies), and when to file a&#10;Suspicious Activity Report (SAR).</span></p><p class="MsoNormal"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Address a third-party service provider incident,&#10;including defining the related notification responsibilities. The response&#10;program should designate an incident response team and include roles and&#10;responsibilities for team members. The program should include standards for&#10;timely notification to members and outline components of the member notice. </p><p class="MsoNormal">Member notice components should be&#10;provided in plain language and include:</p><p class="MsoListParagraphCxSpFirst"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Incident description</p><p class="MsoListParagraphCxSpMiddle"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Type of member information compromised</p><p class="MsoListParagraphCxSpMiddle"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>How the credit union will prevent further&#10;unauthorized access</p><p class="MsoListParagraphCxSpMiddle"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Informational phone number</p><p class="MsoListParagraphCxSpMiddle"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Reminder to members to remain vigilant over next&#10;12-24 months</p><p class="MsoNormal">&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;</p><p class="MsoListParagraphCxSpLast"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Request to report ID theft to CU promptly</p>&#10;&#10;&#10;&#10;<p class="MsoNormal"><a></a></p>' WHERE [Mat_Question_Id] = 7661
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Supplemental_Info]=N'<p class="MsoNoSpacing"><span class="MsoHyperlink"><b><span>Item(s) for Review: </span></b></span></p><p class="MsoNoSpacing"><span class="MsoHyperlink"><b><span>IT CORE 11:</span></b></span><span class="MsoHyperlink"><span>&#10;List of all third-party service providers with risk ratings and support for the&#10;latest due diligence or monitoring of the core data processor, e-banking&#10;provider, and any newly contracted IT vendors.</span></span></p><p class="MsoNoSpacing"><b>IT CORE 12: </b>Documentation demonstrating contracts with critical service providers address the timely notification of cyber incidents.</p><p class="MsoNoSpacing">&#160;</p><p class="MsoNormal">Credit unions have increasingly developed third party&#10;relationships to meet strategic objectives and enhance member services.&#10;Properly managed and controlled third party relationships provide a wide range&#10;of potential benefits to credit unions and their members. Many credit unions&#10;have utilized third party arrangements to gain expertise, realize economies of&#10;scale, or even reach new members. Leveraging the talents and experience of&#10;third parties can assist credit unions in meeting their members&#8217; needs while&#10;accomplishing their strategic goals. In some cases, third party relationships&#10;are critical to the on-going success of a credit union. </p><p class="MsoNormal">By taking the time to properly evaluate and cultivate third&#10;party arrangements, credit unions can experience a high degree of success.&#10;Prudent credit unions will conduct thorough due diligence and evaluate any&#10;third-party contracts carefully. </p><p class="MsoNormal">Credit unions use due diligence to determine whether the&#10;risks undertaken in a third-party relationship are acceptable in relation to&#10;their risk profile and safety and soundness requirements. Less complex risk&#10;profiles and third-party arrangements typically require less analysis and&#10;documentation. Management may rely on third parties to provide critical&#10;services but remains responsible for ensuring the confidentiality, integrity&#10;and availability of the credit union&#8217;s systems and information. Through&#10;oversight, a credit union monitors the effectiveness of the services provided&#10;by third parties.</p><p class="MsoNormal">Credit unions should only enter into service provider&#10;contracts that have appropriate information security measures. The contract&#10;should be clear about information security roles and responsibilities and&#10;outline the appropriate actions to address incidents of unauthorized access to&#10;or use of the credit union&#39;s member information. The contract should clearly&#10;require timely notification to the credit union of any incidents.</p><p class="MsoNormal">When evaluating third party arrangements, examiners verify&#10;the credit union has addressed the following concepts appropriately for its&#10;size, complexity, and risk profile:</p><ul type="disc">&#10; <li class="MsoNormal">Risk Assessment and Planning.</li>&#10; <li class="MsoNormal">Due Diligence; and</li>&#10; <li class="MsoNormal">Risk Measurement, Monitoring and Control.</li>&#10;</ul><p class="MsoNormal"><b>Vendor List</b></p><p class="MsoNormal">Management should maintain a current listing of all&#10;third-party service providers by risk rating/criticality (high, medium, low&#10;risk OR critical, non-critical, etc.) with a description of the services&#10;provided.&#160; The risk rating dictates the&#10;frequency (and the corresponding level of detail) of ongoing due diligence&#10;reviews by management. In rating risk, management should consider sensitivity&#10;of data accessed or controlled by the service provider. If a vendor has access&#10;to any sensitive information (member, employee, or credit union), stronger&#10;oversight is appropriate. Management should verify that third-party service&#10;providers implement and maintain sufficient controls to mitigate risks. </p><p class="MsoNormal">Although some credit unions outsource third party due&#10;diligence and monitoring, compliance with the credit union&#8217;s vendor management&#10;program&#160; remains the responsibility of&#10;credit union management.</p><p class="MsoNormal"><b>Contracts</b></p><p class="MsoNormal">Contracts are the means for credit union management to&#10;require its service providers to implement appropriate measures designed to&#10;meet the objectives of regulatory guidelines for safeguarding member&#10;information (GLBA guidelines). </p><p class="MsoNormal">Contract considerations:</p><p class="MsoNormal"><span>&#8226;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Timeframe</p><p class="MsoNormal"><span>&#8226;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Details of the service or product to be provided</p><p class="MsoNormal"><span>&#8226;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Adequate and measurable service level agreements&#10;(SLAs)</p><p class="MsoNormal"><span>&#8226;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Compliance with all applicable laws,&#10;regulations, and regulatory guidance</p><p class="MsoNormal"><span>&#8226;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Third party insurance coverage</p><p class="MsoNormal"><span>&#8226;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Subcontractor clauses (permissibility,&#10;impermissibility)</p><p class="MsoNormal"><span>&#8226;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Right to audit</p><p class="MsoNormal"><span>&#8226;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Independent validation of security controls</p><p class="MsoNormal"><span>&#8226;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Confidentiality and security of information,&#10;including provision for prompt return or destruction of the credit union&#39;s data</p><p class="MsoNoSpacing">&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;</p><p class="MsoNormal"><span>&#8226;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Notification of any information security or&#10;business continuity incident in a timely manner.</p>&#10;&#10;&#10;', [Scope]=N'', [Recommend_Action]=N'', [Risk_Addressed]=N'', [Services]=N'' WHERE [Mat_Question_Id] = 7669
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Supplemental_Info]=N'<p class="MsoNoSpacing"><span class="MsoHyperlink"><b><span>Item(s) for Review: </span></b></span></p><p class="MsoNoSpacing"><span class="MsoHyperlink"><b><span>IT CORE 13:</span></b></span><span class="MsoHyperlink"><span>&#10;Business continuity plan (BCP), disaster recovery plan (DRP), business impact&#10;analysis, and BCP/DRP testing results since the prior examination.</span></span></p><p class="MsoNoSpacing"><span>&#160;</span></p><p class="MsoNormal">Disruptions resulting from cyber&#160;events,&#10;natural&#160;disasters, or man-made events can interrupt a credit union&#8217;s&#10;operations and can have a broad impact on the financial sector. <span>Business&#10;continuity management (BCM) is the process of planning for continuity of&#10;operations in the case of disaster. BCM addresses </span>resilience<span>,</span><span class="MsoFootnoteReference"><span><span class="MsoFootnoteReference"><span>[1]</span></span></span></span><span> continuity, and&#10;a credit union&#8217;s response capability to </span>safeguard employees, customers,&#10;and products and services. </p><p class="MsoNormal">A credit union&#8217;s BCM program should align with its strategic&#10;goals and objectives. <span>A BCM program has multiple components, including:</span><span></span></p><p class="MsoListParagraphCxSpFirst"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span><span>Business Impact Analysis (BIA)</span><span></span></p><p class="MsoListParagraphCxSpMiddle"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span><span>Business Continuity Plan (BCP)</span><span></span></p><p class="MsoListParagraphCxSpMiddle"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span><span>Backup and Recovery Plan</span><span></span></p><p class="MsoListParagraphCxSpLast"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span><span>Testing</span><span></span></p><p class="MsoNoSpacing"><a><b>Business Impact Analysis (BIA):&#10;</b></a><b></b></p><p class="MsoNormal"><span>Management&#10;should d</span>evelop a BIA that identifies all business functions and&#10;prioritizes them in order of criticality, analyzes&#10;related&#160;interdependencies&#160;among business processes and systems, and&#10;assesses a&#160;disruption&#8217;s impact through established metrics. The BIA should&#10;estimate a recovery time objective (RTO) and recovery point objective and&#10;define recovery priorities and resource dependencies for critical business&#10;processes. Ideally, RTOs are derived from a business impact analysis or similar&#10;effort to estimate the cost of downtime over various timeframes (short, medium,&#10;and longer term). If critical activities cannot be recovered within the defined&#10;RTO, the credit union should establish alternative processes <span>to resume critical activities.</span></p><p class="MsoNoSpacing"><a><b>Business Continuity Plan&#10;(BCP):</b></a><b> </b></p><p class="MsoNormal">The&#10;credit union should have a board-approved business continuity, disaster&#10;recovery, and data backup program to recover operations following an incident.&#10;The BCP should address:</p><p class="MsoListParagraphCxSpFirst"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>BIA and risk assessment.</p><p class="MsoListParagraphCxSpMiddle"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Alternate processing for critical business&#10;functions while systems/applications and facilities are unavailable.</p><p class="MsoListParagraphCxSpMiddle"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Recovery strategies and procedures for critical&#10;systems/applications. </p><p class="MsoListParagraphCxSpMiddle"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Roles and responsibilities; and</p><p class="MsoListParagraphCxSpLast"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>BCP and disaster recovery testing.</p><p class="MsoNormal"><b>A backup and recovery plan</b> describes how critical&#10;systems are backed up and restored. Critical systems&#39; data is typically backed&#10;up at least daily, and recovery from backups should be tested periodically to&#10;verify the backup process is functioning properly.</p><p class="MsoNormal">The BCP focuses on critical business functions and varies&#10;according to the credit union&#8217;s size and complexity. The BCP includes specific&#10;elements, such as incident response, disaster recovery, and crisis management.&#10;Smaller credit unions may have a single BCP that includes these elements. Large,&#10;complex credit unions may have multiple plans specific to business functions,&#10;locations, or departments. </p><p class="MsoNormal">A comprehensive plan based on FFIEC&#8217;s BCP booklet would&#10;include:</p><ul type="disc">&#10; <li class="MsoNormal">Roles,&#10;     responsibilities, and required skills for credit union personnel and third-party service providers</li>&#10; <li class="MsoNormal">Solutions to various types of foreseeable disruptions (for example, fires, floods,&#10;     etc.) including disruptions caused by cyber threat actors</li>&#10; <li class="MsoNormal">Escalation&#10;     thresholds</li>&#10; <li class="MsoNormal">Immediate&#10;     steps to protect personnel and customers and minimize damage</li>&#10; <li class="MsoNormal">Prioritization&#10;     and procedures to recover functions, services, and processes</li>&#10; <li class="MsoNormal">Critical&#10;     information protection (for example, physical, electronic, hybrid, and use&#10;     of off-site storage)</li>&#10; <li class="MsoNormal">Alternate&#10;     site plans including logistical arrangements (for example, housing,&#10;     transportation, or food) for personnel at the recovery locations</li>&#10; <li class="MsoNormal">Network&#10;     equipment, connectivity, and communication needs, including credit&#10;     union-owned and personal mobile devices</li>&#10; <li class="MsoNormal">Personnel&#10;     at alternate sites, including arrangements for those permanently located&#10;     at the alternate facility</li>&#10; <li class="MsoNormal">Scope&#10;     and frequency of testing</li>&#10; <li class="MsoNormal">Pandemic&#10;     plans</li>&#10; <li class="MsoNormal">Resumption&#10;     of a normalized state for business processes</li>&#10;</ul><p class="MsoNormal"><b><u><span>&#160;</span></u></b></p><p class="MsoNormal">The BCP should be a living document, regularly updated so&#10;that it remains current with system enhancements and organizational changes. </p><p class="MsoNoSpacing"><b>Testing: </b></p><p class="MsoNoSpacing">The BCP plan should require testing at a set frequency to&#10;validate the effectiveness of the credit union&#8217;s BCP and identify deficiencies.&#10;Exercises and tests&#160;help validate a credit union&#8217;s ability to restore&#10;critical business functions quickly. They also confirm that critical business&#10;functions are resilient and can maintain continuity. There are many types of&#10;exercises, depending on the intended goals and objectives. Exercises may&#10;include&#160;scenario-driven simulations of BCP elements. For example,&#10;exercises may include performing duties in a simulated environment (in other&#10;words, functional testing) or be discussion based (in other words, tabletop&#10;exercises). Testing should encompass internal and external dependencies, including&#10;activities outsourced to third-party service providers. A credit union does not&#10;need to test all systems simultaneously but should follow a comprehensive&#10;rotation of testing to cover all essential systems.<b></b></p><p class="MsoNormal"><span>Third-party service providers deliver critical services to&#10;many credit unions and should be included in the enterprise-wide exercise and&#10;testing program. A third party&#8217;s inclusion in the credit union&#8217;s BCP should be&#10;commensurate with the criticality of the third-party service provider and its&#10;involvement in the business function.</span><span></span></p><p class="MsoNormal">&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;</p><div><br clear="all">&#10;&#10;<hr align="left" size="1" width="33%">&#10;&#10;&#10;&#10;<div>&#10;&#10;<p class="MsoNormal"><span class="MsoFootnoteReference"><span class="MsoFootnoteReference"><span>[1]</span></span></span>&#10;Resilience includes proactive measures to mitigate disruptive events and&#10;evaluate a credit union&#8217;s recovery capabilities.&#160;</p>&#10;&#10;</div>&#10;&#10;</div>&#10;&#10;&#10;' WHERE [Mat_Question_Id] = 7674
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Supplemental_Info]=N'<p class="MsoNoSpacing"><span class="MsoHyperlink"><b><span>Item(s) for Review: </span></b></span></p>&#10;&#10;<p class="MsoNoSpacing"><span class="MsoHyperlink"><b><span>IT CORE 14:</span></b></span><span class="MsoHyperlink"><span>&#10;Patch management procedures and the three most recent patch management reports&#10;for operating systems and software applications.</span></span></p>&#10;&#10;<p class="MsoNoSpacing"><span>&#160;</span></p>&#10;&#10;<p class="MsoNormal">Patch Management is an easy concept to understand, but a&#10;challenge to execute. Patch management is the process of identifying,&#10;acquiring, installing, and verifying patches for products and systems. Patches&#10;correct security and functionality problems in software and firmware. Patch&#10;management is required by various security compliance frameworks, mandates, and&#10;other policies. For example, NIST Special Publication (SP) 800-532 establishes&#10;the SI-2, Flaw Remediation security control, which includes: </p>&#10;&#10;<p class="MsoListParagraphCxSpFirst"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Installing security-relevant software and&#10;firmware patches, </p>&#10;&#10;<p class="MsoListParagraphCxSpMiddle"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Testing patches before installing them, and </p>&#10;&#10;<p class="MsoListParagraphCxSpLast"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Incorporating patches into the organization&#8217;s&#10;configuration management processes. </p>&#10;&#10;<p class="MsoNormal">Another example is the Payment Card Industry Data Security&#10;Standard, which requires installing the latest patches and sets a maximum&#10;timeframe for installing the most critical patches.</p>&#10;&#10;<p class="MsoNormal">Vendors routinely issue patches or security updates to&#10;address vulnerabilities found on institutions systems. <b>Best Practice CIS&#10;Safeguard 7.4</b> recommends monthly updates at a minimum. The latest patches&#10;should be deployed to critical systems as soon as possible. If critical patches&#10;are not applied promptly, a hacker could exploit these vulnerabilities to&#10;access sensitive data. An effective patch management plan will include:</p>&#10;&#10;<p class="MsoListParagraphCxSpFirst"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>A patching schedule, </p>&#10;&#10;<p class="MsoListParagraphCxSpMiddle"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Expected timeframes for applying patches based&#10;on</p>&#10;&#10;<p class="MsoListParagraphCxSpMiddle"><span>o<span>&#160;&#160;&#10;</span></span>criticality</p>&#10;&#10;<p class="MsoListParagraphCxSpMiddle"><span>o<span>&#160;&#160;&#10;</span></span>risk</p>&#10;&#10;<p class="MsoListParagraphCxSpMiddle"><span>o<span>&#160;&#160;&#10;</span></span>testing environment</p>&#10;&#10;<p class="MsoListParagraphCxSpLast"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>A reporting function that covers which patches&#10;have and have not been applied. </p>&#10;&#10;<p class="MsoNormal">By testing software and firmware updates, a credit union can&#10;identify compatibility and instability issues that could cause serious&#10;operational disruptions.</p>&#10;&#10;<p class="MsoNormal">Keeping up with patches is challenging to manage even for&#10;less complex credit unions. Management should implement automated patch&#10;management systems and software to protect all network components, including&#10;servers, VMs, routers, switches, mobile devices, and firewalls, with&#10;appropriate updates.<span> </span>Some systems may be manually patched. </p>&#10;&#10;<p class="MsoNormal">Patch management solutions can produce a variety of reports,&#10;including patch compliance, exceptions, and days outstanding. Missing critical&#10;patches to servers, desktops, laptops, and other devices should be remediated&#10;as soon as possible unless there is an approved exception. If patch management&#10;is outsourced to a vendor, then the vendor should provide patch status reports&#10;to the credit union&#8217;s management. </p>&#10;&#10;<p class="MsoNormal">Vulnerability scans help detect vulnerabilities for which&#10;there are patches available that may not have been installed.</p>&#10;&#10;<p class="MsoNormal">Credit unions should develop a plan to continuously assess&#10;and track vulnerabilities on all enterprise assets within the enterprise&#8217;s&#10;infrastructure, to remediate and minimize a window of opportunity for&#10;attackers. Hackers will attempt to exploit these vulnerabilities to get access&#10;to the institution&#8217;s data. Management should monitor public and private&#10;industry sources for new threat and vulnerability information.&#160;</p><p class="MsoNoSpacing"></p>' WHERE [Mat_Question_Id] = 7679
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Supplemental_Info]=N'<p class="MsoNoSpacing"><span class="MsoHyperlink"><b><span>Item(s) for Review: </span></b></span></p>&#10;&#10;<p class="MsoNoSpacing"><span class="MsoHyperlink"><b><span>IT CORE 15:</span></b></span><span class="MsoHyperlink"><span>&#10;Documentation to support antivirus/malware protection is running on endpoints&#10;and servers, to include periodic signature updates, an alert function, and&#10;management status reports.</span></span></p>&#10;&#10;<p class="MsoNoSpacing">&#160;</p>&#10;&#10;<p class="MsoNormal">Antivirus/anti-malware protection is preventative software&#10;that detects, neutralizes, and removes malware. Using a regularly updated&#10;database of malware and viruses, it scans a device, comparing its files to the&#10;files in its database. The software also scans the device for any suspicious&#10;behaviors that could indicate malware, which allows the software to detect&#10;malware even if it&#8217;s not already in the database. </p>&#10;&#10;<p class="MsoNormal">Credit union management should require the IT function to:</p>&#10;&#10;<p class="MsoListParagraphCxSpFirst"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Install anti-virus/anti-malware on all desktops,&#10;laptops, and servers.</p>&#10;&#10;<p class="MsoListParagraphCxSpMiddle"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Deploy signature updates automatically. </p>&#10;&#10;<p class="MsoListParagraphCxSpMiddle"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Send notification when a virus is detected; and </p>&#10;&#10;<p class="MsoListParagraphCxSpLast"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Make reports or dashboards available for review.&#10;</p>&#10;&#10;<p class="MsoNoSpacing"><span>Any devices excluded from&#10;malware protection should be documented and approved by management. All&#10;end-point devices should be protected. The reports can be compared to asset&#10;inventory reports to ensure all devices are included. An antivirus scan report&#10;provides details on the antivirus (AV) scans run on selected endpoints or&#10;endpoints in a selected group within the specified report. The details include&#10;the type of scan, scan duration, malware that are detected and action taken on&#10;each identified threat. The latest tools provide behavior-based anti-malware as&#10;compared to signature-based. New forms of malware can only be detected by&#10;behavior-based detection mechanisms.</span></p>&#10;&#10;<p class="MsoNoSpacing"><span>&#160;</span></p>&#10;&#10;<p class="MsoNoSpacing"><span>Antivirus and anti-malware&#10;tools help protect data and systems by detecting malicious code or malware to&#10;include viruses, Trojans, rootkits, and destructive malware. Having antivirus&#10;and malware protection on systems, desktops, laptops, and other devices is&#10;critical given today&#39;s threats. IT staff should provide status reports to the&#10;IT committee or management confirming that devices are up to date.</span></p><p class="MsoNoSpacing"></p>' WHERE [Mat_Question_Id] = 7683
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Supplemental_Info]=N'<p class="MsoNoSpacing"><span class="MsoHyperlink"><b><span>Item(s) for Review: </span></b></span></p><p class="MsoNoSpacing"><span class="MsoHyperlink"><b><span>IT CORE 16:</span></b></span><span class="MsoHyperlink"><span>&#10;Procedures and forms for granting or adjusting employee access to systems and&#10;applications. Also provide support for user access reviews, including&#10;monitoring on inactive accounts, conducted since the prior examination.</span></span></p><p class="MsoNoSpacing">&#160;</p><p class="MsoNoSpacing"><span>Credit unions should&#10;establish and follow a formal process for granting access to enterprise assets&#10;when hiring a new employee, or when an employee changes roles. Credit unions&#10;should also establish and follow a formal process for revoking access to&#10;enterprise assets, including disabling accounts immediately upon termination.&#10;Disabling accounts instead of deleting them may be necessary to preserve audit&#10;trails. Formalized processes include supporting policies or procedures and&#10;tracking of user access change requests via IT ticketing systems and/or change&#10;request forms. </span></p><p class="MsoNoSpacing"><span>&#160;</span></p><p class="MsoNoSpacing"><b><span>Best practices </span></b></p><p class="MsoNoSpacing"><b><span>CIS Safeguards 5.2 Use&#10;Unique Passwords:</span></b></p><p class="MsoNormal">Implementation includes, at a&#10;minimum, an 8-character password for accounts using MFA and a 14-character&#10;password for accounts not using MFA. Delete or disable any inactive accounts&#10;after a period of 45 days of inactivity, where supported.</p><p class="paragraph"><span class="normaltextrun"><b><span>NIST&#10;7621, Small Business Information Security, The Fundamentals:</span></b></span><b><span></span></b></p><p class="MsoNormal"><span class="normaltextrun">Good&#10;passwords consist of a random sequence of letters (upper case and lower case),&#10;numbers, and special characters, and are at least 12 characters long. For&#10;systems or applications that have important information, use multiple forms of&#10;identification (called MFA or &#8220;dual factor&#8221; authentication). For example, when&#10;a user logs in with a password, they may be sent a text message with a code&#10;they have to enter as well. Biometrics, such as fingerprint readers, and other&#10;identification devices may be used but can be expensive and difficult to&#10;install or maintain. </span></p><p class="MsoNormal"><b>Microsoft Best practices for&#10;Windows 10</b> includes a minimum 14-character password as noted here.</p><p class="MsoNormal"><b>NIST Digital Identity Guidelines 800-63-3 defines MFA:</b><b><span> </span></b></p><p class="MsoQuote">An authentication system that&#10;requires more than one distinct <span>authentication factor</span> for successful&#10;authentication. Multi-factor authentication (MFA) can be performed using a&#10;multi-factor authenticator or by a combination of authenticators that provide&#10;different factors.</p><p class="MsoNormal">The three type of factors are:</p><p class="MsoListParagraphCxSpFirst"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Something you know&#8212;a password or personal&#10;identification number</p><p class="MsoListParagraphCxSpMiddle"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Something you have&#8212;an ID badge, token, or a&#10;cryptographic key</p><p class="MsoListParagraphCxSpLast"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Something you are&#8212;a fingerprint or other&#10;biometric data</p><p class="MsoNormal">Additional resources in this area&#10;include FFIEC Guidance &#8220;<i>Authentication and Access to Financial Institution&#10;Services and Systems</i>&#8221;.</p><p class="MsoNoSpacing">&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;<b><span>CIS Safeguards 6.4 and 6.5</span></b><span> also establishes MFA for remote access and all&#10;privileged or administrator accounts.</span><br></p>&#10;&#10;&#10;' WHERE [Mat_Question_Id] = 7687
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Supplemental_Info]=N'<p class="MsoNoSpacing"><span class="MsoHyperlink"><b><span>Item(s) for Review: </span></b></span></p><p class="MsoNoSpacing"><span class="MsoHyperlink"><b><span>IT CORE 17:</span></b></span><span class="MsoHyperlink"><span>&#10;Documentation of network defense and perimeter controls to include a network&#10;diagram, firewalls, and intrusion detection/prevention systems.</span></span></p><p class="MsoNoSpacing">&#160;</p><p class="MsoNormal"><a></a>&#160;A credit union&#39;s network perimeter enables or&#10;restricts connection to, and communication with, the internet. To control&#10;network traffic, the credit union should use devices such firewalls to restrict&#10;and filter traffic. A firewall is a network device or application that prevents&#10;unauthorized access either to or from trusted and untrusted networks. A credit&#10;union or its service provider should establish specific firewall rules that&#10;either allow or deny inbound and outbound traffic and access to the network. </p><p class="MsoNormal">Intrusion detection systems (IDS)&#10;or intrusion prevention systems (IPS) help identify unusual activity by&#10;analyzing network traffic and sending alerts, and in the case of IPS, blocking&#10;traffic from entering the network. While both <b>IDS</b> and ISP can typically alert&#10;personnel to potential attacks, <b>IPS</b> can be configured to block activity&#10;or take other action predefined by management. Next Generation Firewalls&#10;include advanced threat detection with IPS, if correctly configured by staff.&#10;The tools alone cannot be effective if they are not continually monitored for&#10;anomalous activity. Institutions may have firewall management outsourced to a&#10;third party or monitored internally. Third party service providers should&#10;provide regular reports on the firewall and IDS/IPS monitoring. Additionally, a&#10;credit union should review its firewall rules periodically.</p><p class="MsoNormal">&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;</p><p class="MsoNormal">The network topology diagram(s)&#10;can be used to determine firewall, IDS, and IPS placement on the network.&#160;</p>&#10;&#10;&#10;' WHERE [Mat_Question_Id] = 7691
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Supplemental_Info]=N'<p class="MsoNoSpacing"><span class="MsoHyperlink"><b><span>Item(s) for Review: </span></b></span></p><p class="MsoNoSpacing"><span class="MsoHyperlink"><b><span>IT CORE 18:</span></b></span><span class="MsoHyperlink"><span>&#10;Support for e-mail and web filtering and data loss prevention controls,&#10;including reports or screen shots for the associated settings and rules.</span></span></p><p class="MsoNoSpacing">&#160;</p><p class="MsoNormal">Email and web vectors open opportunities for attackers to&#10;manipulate human behavior through direct engagement. Third parties periodically&#10;release security updates for browsers. The upgrades typically address&#10;vulnerabilities that an attacker could exploit to take control of an affected&#10;system. Browsers should be updated to the most current version as soon as&#10;possible and only supported browsers should be used.</p><p class="MsoNormal">Additional controls include:</p><p class="MsoListParagraphCxSpFirst"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Enforcing and updating network-based URL filters&#10;to limit a credit union computer from connecting to potentially malicious or&#10;unapproved websites, </p><p class="MsoListParagraphCxSpMiddle"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Deploying anti-malware protection solutions to&#10;protect the email system, and </p><p class="MsoListParagraphCxSpLast"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Blocking unnecessary file types with extensions&#10;with .ade, .adp, .app, exe, .jsp, .iso, .jar, and many more. </p><p class="MsoNormal"><b>URL filtering</b> may include <i>category-based filtering</i>,&#10;for example: entertainment, social media, adult material, and others. It can&#10;also include <i>reputation-based filtering</i>, for example: IP blocking by&#10;geographic region, or by using a block list. Credit unions typically have multiple&#10;filtering policies applied based on either departments or specific employee&#10;groups. These web-filtering policies or rules should be reviewed periodically&#10;to ensure they are relevant and necessary based on business needs.</p><p class="MsoNormal">Using a <b>spam-filtering tool and malware scanning at the&#10;email gateway</b> reduces the number of malicious emails and attachments. Cyber&#10;threat actors use phishing and business email compromise (as noted in the CIS&#10;Safeguards and NCUA Risk Alert 19-RISK-01) to exploit employee access to protected&#10;systems. Credit unions should implement recommended controls for email service,&#10;such as anti-phishing, anti-spam and anti-malware.</p><p class="MsoNoSpacing">&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;&#10;</p><p class="MsoNormal"><b>Unnecessary file types</b> increase the risk of a malware&#10;compromise.&#160; One recent study found that 95%&#10;of ransomware samples were Windows-based executable files.&#160; Malware often relies on insecure end-user&#10;behavior, such as opening attachments.</p>&#10;&#10;&#10;' WHERE [Mat_Question_Id] = 7694
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Supplemental_Info]=N'<p class="MsoNoSpacing"><span class="MsoHyperlink"><b><span>Item(s) for Review: </span></b></span></p>&#10;&#10;<p class="MsoNoSpacing"><span class="MsoHyperlink"><b><span>IT CORE 19:</span></b></span><span class="MsoHyperlink"><span>&#10;Documentation supporting the change management process to include changes to&#10;hardware, software, applications, system configurations, and change request and&#10;approval processes.</span></span></p>&#10;&#10;<p class="MsoNoSpacing"><span>&#160;</span></p>&#10;&#10;<p class="MsoNormal"><a></a><a></a>&#160;Change management is a process designed to&#10;understand and minimize risks while making IT changes. The objective of change&#10;management is to support IT service management as it implements rapid change&#10;while minimizing the possibility of disruption to services. Changes can&#10;potentially have significant impact on the security of the systems, therefore&#10;written standards and procedures should guide the process of introducing&#10;changes and defining requirements.</p>&#10;&#10;<p class="MsoNormal">Credit unions should have a documented process to procure&#10;and implement applications and system changes to hardware, software, operating&#10;systems and other areas. Changes can be complex (core conversion, moving to&#10;cloud), or routine (deploying a patch), but all changes should follow a formal&#10;change management process. </p>&#10;&#10;<p class="MsoNormal">The written policy and procedures should address:</p>&#10;&#10;<p class="MsoListParagraphCxSpFirst"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Types of changes,</p>&#10;&#10;<p class="MsoListParagraphCxSpMiddle"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Risk and impact, </p>&#10;&#10;<p class="MsoListParagraphCxSpMiddle"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Testing,</p>&#10;&#10;<p class="MsoListParagraphCxSpMiddle"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Authorization and approval,</p>&#10;&#10;<p class="MsoListParagraphCxSpMiddle"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Timing of implementation,</p>&#10;&#10;<p class="MsoListParagraphCxSpMiddle"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Post installation validation, </p>&#10;&#10;<p class="MsoListParagraphCxSpMiddle"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Back-out or recovery,</p>&#10;&#10;<p class="MsoListParagraphCxSpMiddle"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Notification, and </p>&#10;&#10;<p class="MsoListParagraphCxSpLast"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Oversight.</p>&#10;&#10;<p class="MsoNormal"><span>The </span>FFIEC IT Handbook &#8220;Architecture,&#10;Infrastructure, and Operations<b>&#8221;</b> provides more details on this process:</p>&#10;&#10;<p class="MsoNormal"><b>Change Request:</b> A documented request should outline&#10;the reasons for the change and include the details described in the list below.</p>&#10;&#10;<p class="MsoListParagraphCxSpFirst"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span><b>Authorization and approval:</b> Approval may be&#10;granted by IT management, a formal change committee, the IT steering committee,&#10;or other designated personnel. Approval decisions should be based on the&#10;overall risk of the change to IT environment. </p>&#10;&#10;<p class="MsoListParagraphCxSpMiddle"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span><b>Test and Implementation:</b> Management should&#10;document that the change performs as intended, identify any flaws (e.g.,&#10;integrity issues), and verify that the change integrates with other systems. Management&#10;should also follow a formal process to deploy the change during off peak hours&#10;or planned system outages</p>&#10;&#10;<p class="MsoListParagraphCxSpLast"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span><b>Post installation validation:</b> After&#10;deploying change, management should validate that the change was implemented successfully&#10;and close the change.</p>&#10;&#10;<p class="MsoNormal">It&#8217;s important to include all steps in the change process.&#10;If changes are not properly approved and tested before implementation, the&#10;system may crash or experience glitches that may affect users of the system.&#10;Some of the changes performed frequently or routinely may be pre-approved, such&#10;as patch installation. When there is an ongoing cyber event or critical risk,&#10;other changes like emergency patches or updates may be reviewed and approved&#10;after the fact. Policy and procedures should also address emergency change&#10;process. </p>&#10;&#10;<p class="MsoNormal">A typical change management request for user access should&#10;include: </p>&#10;&#10;<p class="MsoListParagraphCxSpFirst"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>The request</p>&#10;&#10;<p class="MsoListParagraphCxSpMiddle"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>The business purpose or need</p>&#10;&#10;<p class="MsoListParagraphCxSpMiddle"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>The person who reviewed it</p>&#10;&#10;<p class="MsoListParagraphCxSpMiddle"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>The person who authorized/denied it</p>&#10;&#10;<p class="MsoListParagraphCxSpLast"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>How long the access is needed</p>&#10;&#10;<p class="MsoNormal">Additionally, user transitions should trigger a change&#10;request to review or remove permissions and access to information as staff&#10;leave or transition within the credit union. </p>&#10;&#10;<p class="MsoNormal">A change request form should include:</p>&#10;&#10;<p class="MsoListParagraphCxSpFirst"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Change type</p>&#10;&#10;<p class="MsoListParagraphCxSpMiddle"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Implementation timeframe</p>&#10;&#10;<p class="MsoListParagraphCxSpMiddle"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Risk assessment</p>&#10;&#10;<p class="MsoListParagraphCxSpMiddle"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Impact assessment</p>&#10;&#10;<p class="MsoListParagraphCxSpMiddle"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Security considerations</p>&#10;&#10;<p class="MsoListParagraphCxSpMiddle"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Business continuity considerations and impacts</p>&#10;&#10;<p class="MsoListParagraphCxSpMiddle"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Dependencies</p>&#10;&#10;<p class="MsoListParagraphCxSpMiddle"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Testing procedures and results</p>&#10;&#10;<p class="MsoListParagraphCxSpLast"><span>&#183;<span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;</span></span>Back-out procedures</p><p class="MsoListParagraphCxSpLast"><span>&#183;</span><span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;</span><span>&#160;</span><span>Approvals</span></p><p class="MsoNoSpacing"></p>' WHERE [Mat_Question_Id] = 7699
