UPDATE [dbo].[NEW_REQUIREMENT] SET [Requirement_Text]=N'Refer also to 1.2 above. Ensure that a process exists to address unauthorized software and firmware. Process should provide for identification, assessment and ability to immediately remediate where applicable. For Wind end devices, communications systems, workstations and similar critical assets or assets used for communication and data management, unauthorized software/firmware should either be removed or an exception documented with identified remediation measures for any risks. Reviews for unauthorized software/firmware should be conducted on a periodic basis not less than monthly.' WHERE [Requirement_Id] = 31610
UPDATE [dbo].[NEW_REQUIREMENT] SET [Requirement_Text]=N'Document data flows to inform data classification, management, protection/encryption priorities. Ensure review and inclusion of Wind end devices, communications systems, work stations, remote operable devices and assets that communicate directly with external third-party assets/across external networks. Data flow documentation may include service provider data flows. All data flows should be classified and managed as sensitive data.' WHERE [Requirement_Id] = 31621
UPDATE [dbo].[NEW_REQUIREMENT] SET [Requirement_Text]=N'Identify and implement a Multi-Factor Authentication Requirement for all externally facing, remote access/operable and assets located at remote unmanned locations wherever supported. Prioritize application of MFA to Wind and other communications assets with established connections to external networks or third-party assets.' WHERE [Requirement_Id] = 31632
UPDATE [dbo].[NEW_REQUIREMENT] SET [Requirement_Text]=N'Establish and maintain a secure network architecture. A secure network architecture must address segmentation, least privilege, and availability, at a minimum.  Where applicable isolate and/or segregate high-risk assets, security systems, meterological, and operational systems. This includes Wind end devices, workstations, critical communications systems. 

Develop, manage and maintain accurate network architecture diagrams and other network system documentation. Review and update these periodically and ensure configuration and change management processes include requirements to update this documentation whenever asset additions, removals, reconfigurations occur. 

Implement network infrastructure security controls such as: 

- require Multi-Factor Authentication wherever possible
- version-controlled-infrastructure-as-code, and the use of secure network protocols, such as SSH and HTTPS. 
- network management and communication protocols (e.g., 802.1X, Wi-Fi Protected Access 2 (WPA2) Enterprise or greater)
- requre use of VPN and authentication services prior to accessing enterprise or remote access OT assets from end-user devices' WHERE [Requirement_Id] = 31642
