          implementation of cybersecurity requirements at three maturity levels:</p>
     <ul>
          <li>Level 1 (Foundational): Basic safeguarding requirements for FCI specified in FAR Clause 52.204-21,
               self-assessed.</li>
          <li>Level 2 (Advanced): Aligns with NIST SP 800-171, third-party assessed.</li>
          <li>Level 3 (Expert): Targets advanced threats, aligns with NIST SP 800-172, government-assessed.</li>
     </ul>
     <p>Its goal is to provide increased assurance to the DoD that defense contractors and subcontractors are compliant
          with information protection requirements for FCI and CUI.</p>', NULL, N'Cybersecurity Maturity Model Certification (CMMC) 2.0', 0, '2024-11-06 11:16:02.860')
